    'Plants and parts of plants (including seeds and fruits), of a kind used primarily in perfumery, in pharmacy or for insecticidal, fungicidal or similar purposes, fresh, chilled, frozen or dried, whether or not cut, crushed or powdered' => 'Pjanti u l-partijiet tagħhom (inkluż żerriegħa u frott), li jintużaw l-iktar fil-fwejjaħ, fil-farmaċija jew bħala insettiċidi, funġiċidi jew għal finijiet simili, friski, imkessħin, iffriżati jew imnixxfin, kemm jekk maqtugħin, misħuqin jew magħmulin trab u kemm jekk le',
