    'Swedes, mangolds, fodder roots, hay, lucerne (alfalfa), clover, sainfoin, forage kale, lupines, vetches and similar forage products, whether or not in the form of pellets' => 'Lift tal-Iżvezja, mangolds, għeruq għall-foraġġ, ħuxlief, nifel (alfalfa), xnien, sainfoin, kaboċċi għall-foraġġ, lupini, ġulbiena u prodotti simili tal-foraġġ, kemm jekk fil-forma ta’ pellets u kemm jekk le',
    'Lac; natural gums, resins, gum-resins and oleoresins (for example, balsams)' => 'Gommalakka; gomom naturali, rażi, rażi tal-gomma u oleorażi (eż. il-balzmi)',
    'Vegetable saps and extracts; pectic substances, pectinates and pectates; agar-agar and other mucilages and thickeners, whether or not modified, derived from vegetable products' => 'Meraq u estratti veġetali; sustanzi tal-pektin, pektinati u pektati; agar-agar u muċilaġni u materjali li jħaxxnu oħrajn, kemm jekk modifikati u kemm jekk le, derivati minn prodotti veġetali',
    'Vegetable materials of a kind used primarily for plaiting (for example, bamboos, rattans, reeds, rushes, osier, raffia, cleaned, bleached or dyed cereal straw, and lime bark)' => 'Materjali veġetali li jintużaw primarjament għat-trizza (eż. bambù, kannadindja, qasab, ġummar, vireg taż-żafżaf, raffja, tiben taċ-ċereali mnaddaf, ibbliċjat jew miżbugħ, u qoxra tat-tilju)',
