    'Pig fat (including lard) and poultry fat, other than that of heading 0209 or 1503' => 'Xaħam tal-ħanżir (inkluż il-lardu) u xaħam tal-pollam, għajr dak tal-intestatura 0209 jew 1503',
    'Fats of bovine animals, sheep or goats, other than those of heading 1503' => 'Xaħmijiet tal-annimali bovini, tan-nagħaġ u tal-mogħoż, għajr dawk tal-intestatura 1503',
    'Lard stearin, lard oil, oleostearin, oleo-oil and tallow oil, not emulsified or mixed or otherwise prepared' => 'Stearina tal-lardu, żejt tal-lardu, oleostearina, oleomarġerina u żejt tax-xaħam ta’ dam, mhux emulsifikati jew imħalltin jew ippreparati b’xi mod ieħor',
    'Fats and oils and their fractions, of fish or marine mammals, whether or not refined, but not chemically modified' => 'Xaħmijiet u żjut u l-frazzjonijiet tagħhom, tal-ħut jew tal-mammiferi tal-baħar, kemm jekk raffinati u kemm jekk le, iżda mhux modifikati kimikament',
    'Wool grease and fatty substances derived therefrom (including lanolin)' => 'Grass tas-suf u s-sustanzi xaħmin derivati minnu (inkluż il-lanolina)',
    'Soya-bean oil and its fractions, whether or not refined, but not chemically modified' => 'Żejt tal-fażola tas-sojja u l-frazzjonijiet tiegħu, kemm jekk raffinat u kemm jekk le, iżda mhux immodifikat kimikament',
    'Groundnut oil and its fractions, whether or not refined, but not chemically modified' => 'Żejt tal-karawett u l-frazzjonijiet tiegħu, kemm jekk raffinat u kemm jekk le, iżda mhux immodifikat kimikament',
    'Olive oil and its fractions, whether or not refined, but not chemically modified' => 'Żejt taż-żebbuġa u l-frazzjonijiet tiegħu, kemm jekk raffinat u kemm jekk le, iżda mhux immodifikat kimikament',
    'Other oils and their fractions, obtained solely from olives, whether or not refined, but not chemically modified, including blends of these oils or fractions with oils or fractions of heading 1509' => 'Żjut oħrajn u l-frazzjonijiet tagħhom, miksubin biss miż-żebbuġ, kemm jekk raffinati u kemm jekk le, iżda mhux modifikati kimikament, inkluż l-amalgami ta’ dawn iż-żjut jew dawn il-frazzjonijiet biż-żjut jew il-frazzjonijiet tal-intestatura 1509',
    'Palm oil and its fractions, whether or not refined, but not chemically modified' => 'Żejt tal-palm u l-frazzjonijiet tiegħu, kemm jekk raffinat u kemm jekk le, iżda mhux immodifikat kimikament',
    'Sunflower-seed, safflower or cotton-seed oil and fractions thereof, whether or not refined, but not chemically modified' => 'Żejt taż-żerriegħa tal-ġirasol, tal-għosfor jew taż-żerriegħa tal-qoton u l-frazzjonijiet tagħhom, kemm jekk raffinati u kemm jekk le, iżda mhux immodifikati kimikament',
    'Coconut (copra), palm kernel or babassu oil and fractions thereof, whether or not refined, but not chemically modified' => 'Żejt tal-ġewż tal-Indi (kopra), tal-lewż tal-palm jew żejt babassu u l-frazzjonijiet tagħhom, kemm jekk raffinati u kemm jekk le, iżda mhux immodifikati kimikament',
    'Rape, colza or mustard oil and fractions thereof, whether or not refined, but not chemically modified' => 'Żejt tal-lift, tal-kolza jew tal-mustarda u l-frazzjonijiet tagħhom, kemm jekk raffinati u kemm jekk le, iżda mhux modifikati kimikament',
    'Other fixed vegetable or microbial fats and oils (including jojoba oil) and their fractions, whether or not refined, but not chemically modified' => 'Xaħmijiet u żjut veġetali jew mikrobiċi fissi oħrajn (inkluż iż-żejt tal-jojoba) u l-frazzjonijiet tagħhom, kemm jekk raffinati u kemm jekk le, iżda mhux modifikati kimikament',
    'Animal, vegetable or microbial fats and oils and their fractions, partly or wholly hydrogenated, inter-esterified, re-esterified or elaidinised, whether or not refined, but not further prepared' => 'Ix-xaħmijiet u ż-żjut tal-annimali, veġetali jew mikrobiċi u l-frazzjonijiet tagħhom, parzjalment jew kompletament idroġenati, esterifikati bejniethom, riesterifikati jew elajdinizzati, kemm jekk raffinati u kemm jekk le, iżda mhux ippreparati mod ieħor',
    'Margarine; edible mixtures or preparations of animal, vegetable or microbial fats or oils or of fractions of different fats or oils of this chapter, other than edible fats or oils or their fractions of heading 1516' => 'Il-marġerina; it-taħlitiet jew il-preparati tajbin għall-ikel tax-xaħmijiet jew taż-żjut tal-annimali, veġetali jew mikrobiċi jew tal-frazzjonijiet ta’ xaħmijiet u żjut differenti ta’ dan il-Kapitolu, għajr ix-xaħmijiet u ż-żjut tajbin għall-ikel jew il-frazzjonijiet tagħhom tal-intestatura 1516',
    'Animal, vegetable or microbial fats and oils and their fractions, boiled, oxidised, dehydrated, sulphurised, blown, polymerised by heat in vacuum or in inert gas or otherwise chemically modified, excluding those of heading 1516; inedible mixtures or preparations of animal, vegetable or microbial fats or oils or of fractions of different fats or oils of this chapter, not elsewhere specified or included' => 'Ix-xaħmijiet u ż-żjut tal-annimali, veġetali jew mikrobiċi u l-frazzjonijiet tagħhom, mgħollijin, ossidizzati, deidrati, sulfurizzati, minfuħin, polimerizzati bis-sħana ġewwa vakwu jew ġewwa gass inerti jew modifikati kimikament mod ieħor, ħlief dawk tal-intestatura 1516; it-taħlitiet jew il-preparati tax-xaħmijiet jew taż-żjut tal-annimali, veġetali jew mikrobiċi li ma jistgħux jittieklu jew tal-frazzjonijiet ta’ xaħmijiet jew żjut differenti ta’ dan il-Kapitolu, li mhumiex speċifikati jew inklużi banda oħra',
    'Vegetable waxes (other than triglycerides), beeswax, other insect waxes and spermaceti, whether or not refined or coloured' => 'Xemgħat veġetali (għajr it-trigliċeridi), xemgħa tan-naħal, xemgħat u spermaċeti ta’ insetti oħrajn, kemm jekk raffinati jew kuluriti u kemm jekk le',
    'Degras; residues resulting from the treatment of fatty substances or animal or vegetable waxes' => 'Degras; residwi mit-trattament tas-sustanzi xaħmin jew tax-xemgħat tal-annimali jew veġetali',
    'Sausages and similar products, of meat, meat offal, blood or insects; food preparations based on these products' => 'Iz-zalzett u prodotti simili, tal-laħam, tal-ġewwieni tal-laħam, tad-demm jew tal-insetti; il-preparati tal-ikel ibbażati fuq dawn il-prodotti',
    'Other prepared or preserved meat, meat offal, blood or insects' => 'Laħam, ġewwieni tal-laħam, demm jew insetti ppreparati jew ippreservati oħrajn',
    'Extracts and juices of meat, fish or crustaceans, molluscs or other aquatic invertebrates' => 'Estratti u sugu tal-laħam, tal-ħut jew tal-krustaċji, tal-molluski jew ta’ invertebrati akkwatiċi oħrajn',
    'Prepared or preserved fish; caviar and caviar substitutes prepared from fish eggs' => 'Ħut ippreparat jew ippreservat; il-kavjar u s-sostituti tal-kavjar ippreparati mill-bajd tal-ħut',
    'Crustaceans, molluscs and other aquatic invertebrates, prepared or preserved' => 'Krustaċji, molluski u invertebrati akkwatiċi oħrajn, ippreparati jew ippreservati',
    'Cane or beet sugar and chemically pure sucrose, in solid form' => 'Zokkor tal-kannamiela jew tal-pitravi u sukrożju kimikament pur, f’forma solida',
