    'Molasses resulting from the extraction or refining of sugar' => 'Melassa li tirriżulta mill-estrazzjoni jew mir-raffinar taz-zokkor',
    'Sugar confectionery (including white chocolate), not containing cocoa' => 'Ħlewwiet taz-zokkor (inkluż ċikkulata bajda) li ma fihomx kawkaw',
