    'Pasta, whether or not cooked or stuffed (with meat or other substances) or otherwise prepared, such as spaghetti, macaroni, noodles, lasagne, gnocchi, ravioli, cannelloni; couscous, whether or not prepared' => 'Għaġin, kemm jekk imsajjar jew mimli (bil-laħam jew sustanzi oħrajn) u kemm jekk le jew ippreparat mod ieħor, bħal eż. spagetti, imqarrun, noodles, lażanja, injokki, ravjul, kannelloni; kuskus, ippreparat jew le',
    'Prepared foods obtained by the swelling or roasting of cereals or cereal products (for example, corn flakes); cereals (other than maize (corn)) in grain form or in the form of flakes or other worked grains (except flour, groats and meal), pre-cooked or otherwise prepared, not elsewhere specified or included' => 'Ikel ippreparat miksub min-nefħa jew mill-inkaljar taċ-ċereali jew tal-prodotti taċ-ċereali (eż. corn flakes); ċereali (għajr qamħirrum (qamħ)) fil-forma ta’ ħbub jew fil-forma ta’ fjokki jew ħbub ieħor maħdum (ħlief dqiq, ħbub imfesdaq u grixa), imsajrin minn qabel jew ippreparati mod ieħor, li mhumiex speċifikati jew inklużi banda oħra',
    'Bread, pastry, cakes, biscuits and other bakers\' wares, whether or not containing cocoa; communion wafers, empty cachets of a kind suitable for pharmaceutical use, sealing wafers, rice paper and similar products' => 'Ħobż, għaġina, kejkijiet, gallettini u prodotti oħrajn tal-furnara, kemm jekk fihom il-kawkaw u kemm jekk le; ostji tat-tqarbin, cachets vojta li huma adattati għall-użu farmaċewtiku, wafers tas-siġill, karta tar-ross u prodotti simili',
    'Vegetables, fruit, nuts and other edible parts of plants, prepared or preserved by vinegar or acetic acid' => 'Ħaxix, frott, ġewż u partijiet oħrajn ta’ pjanti tajbin għall-ikel, ippreparati u ppreservati bil-ħall jew bl-aċidu aċetiku',
    'Tomatoes prepared or preserved otherwise than by vinegar or acetic acid' => 'Tadam ippreparat jew ippreservat mod ieħor milli bil-ħall jew bl-aċidu aċetiku',
    'Mushrooms and truffles, prepared or preserved otherwise than by vinegar or acetic acid' => 'Faqqiegħ u tartuf, ippreparati jew ippreservati mod ieħor milli bil-ħall jew bl-aċidu aċetiku',
    'Other vegetables prepared or preserved otherwise than by vinegar or acetic acid, frozen, other than products of heading 2006' => 'Ħaxix ieħor, ippreparat jew ippreservat mod ieħor milli bil-ħall jew bl-aċidu aċetiku, iffriżat, għajr prodotti tal-intestatura 2006',
    'Other vegetables prepared or preserved otherwise than by vinegar or acetic acid, not frozen, other than products of heading 2006' => 'Ħaxix ieħor, ippreparat jew ippreservat mod ieħor milli bil-ħall jew bl-aċidu aċetiku, mhux iffriżat, għajr prodotti tal-intestatura 2006',
    'Vegetables, fruit, nuts, fruit-peel and other parts of plants, preserved by sugar (drained, glacé or crystallised)' => 'Ħaxix, frott, ġewż, qoxra tal-frott u partijiet oħrajn tal-pjanti, ippreservati biz-zokkor (imqattra, glacé jew kristallizzati)',
    'Jams, fruit jellies, marmalades, fruit or nut purée and fruit or nut pastes, obtained by cooking, whether or not containing added sugar or other sweetening matter' => 'Ġammijiet, jellies tal-frott, marmellati, purée tal-frott jew tal-ġewż u pastes tal-frott u tal-ġewż, miksubin bit-tisjir, kemm jekk fihom iz-zokkor jew dolċifikant ieħor miżjud u kemm jekk le',
    'Fruit, nuts and other edible parts of plants, otherwise prepared or preserved, whether or not containing added sugar or other sweetening matter or spirit, not elsewhere specified or included' => 'Frott, ġewż u partijiet oħrajn tal-pjanti tajbin għall-ikel, ippreparati jew ippreservati mod ieħor, kemm jekk fihom iz-zokkor jew dolċifikant ieħor jew spirtu miżjud u kemm jekk le, li mhumiex speċifikati jew inklużi banda oħra',
    'Fruit or nut juices (including grape must and coconut water) and vegetable juices, unfermented and not containing added spirit, whether or not containing added sugar or other sweetening matter' => 'Il-meraq tal-frott jew tal-ġewż (inkluż il-most tal-għeneb u l-ilma tal-ġewż tal-Indi) u l-meraq tal-ħaxix, mhux iffermentat u li ma fihx spirtu miżjud, kemm jekk fih iz-zokkor jew dolċifikant ieħor miżjud u kemm jekk le',
    'Extracts, essences and concentrates, of coffee, tea or maté and preparations with a basis of these products or with a basis of coffee, tea or maté; roasted chicory and other roasted coffee substitutes, and extracts, essences and concentrates thereof' => 'Estratti, essenzi u konċentrati, tal-kafè, tat-te jew tal-maté u preparati b’bażi ta’ dawn il-prodotti jew b’bażi ta’ kafè, te jew maté; ċikwejra nkaljata u sostituti tal-kafè oħrajn inkaljati, u estratti, essenzi u konċentrati tagħhom',
    'Yeasts (active or inactive); other single-cell micro-organisms, dead (but not including vaccines of heading 3002); prepared baking powders' => 'Ħmira (attiva jew inattiva); mikroorganiżmi oħrajn b’ċellola waħda, mejtin (iżda ma jinkludux il-vaċċini tal-intestatura 3002); trabijiet tal-ħami ppreparati',
    'Sauces and preparations therefor; mixed condiments and mixed seasonings; mustard flour and meal and prepared mustard' => 'Zlazi u preparati tagħhom; kondimenti mħalltin u taħwir tal-ikel imħallat; dqiq u grixa tal-mustarda u mustarda ppreparata',
    'Soups and broths and preparations therefor; homogenised composite food preparations' => 'Sopop u brodi u preparati tagħhom; preparati tal-ikel komposti omoġenizzati',
    'Ice cream and other edible ice, whether or not containing cocoa' => 'Ġelati u silġ ieħor tajjeb għall-ikel, kemm jekk ikun fihom il-kawkaw u kemm jekk le',
    'Food preparations not elsewhere specified or included' => 'Preparati tal-ikel li mhumiex speċifikati jew inklużi banda oħra',
    'Waters, including natural or artificial mineral waters and aerated waters, not containing added sugar or other sweetening matter nor flavoured; ice and snow' => 'Ilmijiet, inkluż ilmijiet minerali naturali jew artifiċjali u l-ilmijiet aerati, mingħajr zokkor jew dolċifikant ieħor miżjud u mhux aromatizzati; is-silġ u l-borra',
    'Waters, including mineral waters and aerated waters, containing added sugar or other sweetening matter or flavoured, and other non-alcoholic beverages, not including fruit, nut or vegetable juices of heading 2009' => 'Ilmijiet, inkluż ilmijiet minerali u ilmijiet aerati, biz-zokkor jew dolċifikant ieħor miżjud jew aromatizzati, u xarbiet oħrajn mhux alkoħoliċi, eskluż il-meraq tal-frott jew tal-ħaxix tal-intestatura 2009',
    'Beer made from malt' => 'Birra magħmula mill-malt',
