    'Inorganic or organic compounds of mercury, whether or not chemically defined, excluding amalgams' => 'Komposti inorganiċi jew organiċi tal-merkurju, kemm jekk definiti kimikament u kemm jekk le, eskluż amalgami',
    'Phosphides, whether or not chemically defined, excluding ferrophosphorus; other inorganic compounds (including distilled or conductivity water and water of similar purity); liquid air (whether or not rare gases have been removed); compressed air; amalgams, other than amalgams of precious metals' => 'Fosfidi, kemm jekk definiti kimikament u kemm jekk le, eskluż il-ferrofosforu; komposti inorganiċi oħrajn (inkluż ilma distillat jew ilma ta’ konduttività u l-ilma ta’ purità simili); arja likwida (kemm jekk ikunu tneħħew il-gassijiet rari u kemm jekk le); arja kompressata; amalgami, għajr amalgami tal-metalli prezzjużi',
