    'Cyclic hydrocarbons' => 'Idrokarburi ċikliċi',
    'Halogenated derivatives of hydrocarbons' => 'Derivattivi aloġenati tal-idrokarburi',
    'Sulphonated, nitrated or nitrosated derivatives of hydrocarbons, whether or not halogenated' => 'Derivattivi tal-idrokarburi sulfonati, nitrati jew nitrożati, kemm jekk aloġenati u kemm jekk le',
    'Acyclic alcohols and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Alkoħols aċikliċi u derivattivi aloġenati, sulfonati, nitrati jew nitrożati tagħhom',
    'Cyclic alcohols and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Alkoħols ċikliċi u derivattivi aloġenati, sulfonati, nitrati jew nitrożati tagħhom',
    'Phenols; phenol-alcohols' => 'Fenoli; fenolalkoħols',
    'Halogenated, sulphonated, nitrated or nitrosated derivatives of phenols or phenol-alcohols' => 'Derivattivi aloġenati, sulfonati, nitrati jew nitrożati tal-fenoli jew tal-fenolalkoħols',
    'Ethers, ether-alcohols, ether-phenols, ether-alcohol-phenols, alcohol peroxides, ether peroxides, acetal and hemiacetal peroxides, ketone peroxides (whether or not chemically defined), and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Eteri, eter-alkoħols, eter-fenoli, eter-alkoħol-fenoli, perossidi tal-alkoħol, perossidi tal-etere, perossidi aċetali u emiaċetali, perossidi tal-keton (kemm jekk definiti kimikament u kemm jekk le), u derivattivi aloġenati, sulfonati, nitrati jew nitrożati tagħhom',
    'Epoxides, epoxyalcohols, epoxyphenols and epoxyethers, with a three-membered ring, and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Epossidi, epossialkoħols epossifenoli u epossieteri, b’ċirku bi tliet membri, u derivattivi aloġenati, sulfonati, nitrati jew nitrożati tagħhom',
    'Aldehydes, whether or not with other oxygen function; cyclic polymers of aldehydes; paraformaldehyde' => 'Aldeidi, kemm jekk b’funzjoni oħra ta’ ossiġenu u kemm jekk le; polimeri ċikliċi tal-aldeidi; paraformaldeid',
    'Ketones and quinones, whether or not with other oxygen function, and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Ketoni u kinoni, kemm jekk b’funzjoni ossiġenu u kemm jekk le, u derivattivi aloġenati, sulfonati, nitrati jew nitrożati tagħhom',
    'Saturated acyclic monocarboxylic acids and their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Aċidi monokarbossiliċi aċikliċi saturati u anidridi, aloġenuri, perossidi u perossiaċidi tagħhom; derivattivi aloġenati, sulfonati, nitrati jew nitrożati tagħhom',
    'Unsaturated acyclic monocarboxylic acids, cyclic monocarboxylic acids, their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Aċidi monokarbossiliċi aċikliċi mhux saturati, aċidi monokarbossiliċi ċikliċi, anidridi, aloġenuri, perossidi u perossiaċidi tagħhom; derivattivi aloġenati, sulfonati, nitrati jew nitrożati tagħhom',
    'Polycarboxylic acids, their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Aċidi polikarbossiliċi, anidridi, aloġenuri, perossidi u perossiaċidi tagħhom; derivattivi aloġenati, sulfonati, nitrati jew nitrożati tagħhom',
    'Carboxylic acids with additional oxygen function and their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Aċidi karbossiliċi b’funzjoni addizzjonali ta’ ossiġenu u anidridi, aloġenuri, perossidi u perossiaċidi tagħhom; derivattivi aloġenati, sulfonati, nitrati jew nitrożati tagħhom',
    'Phosphoric esters and their salts, including lactophosphates; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Esteri fosforiċi u l-imlieħ tagħhom, inkluż lattofosfati; derivattivi aloġenati, sulfonati, nitrati jew nitrożati tagħhom',
    'Esters of other inorganic acids of non-metals (excluding esters of hydrogen halides) and their salts; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Esteri ta’ aċidi inorganiċi oħrajn ta’ nonmetalli (ħlief esteri tal-aloġenuri tal-idroġenu) u l-imlieħ tagħhom, derivattivi aloġenati, sulfonati, nitrati jew nitrożati tagħhom hom',
    'Amine-function compounds' => 'Komposti b’funzjoni ta’ ammina',
    'Oxygen-function amino-compounds' => 'Komposti tal-ammino b’funzjoni ta’ ossiġenu',
    'Quaternary ammonium salts and hydroxides; lecithins and other phosphoaminolipids, whether or not chemically defined' => 'Imlieħ u idrossidi ta’ ammonju kwaternarju; leċitini u fosfoamminolipidi oħrajn, kemm jekk definiti kimikament u kemm jekk le',
    'Carboxyamide-function compounds; amide-function compounds of carbonic acid' => 'Komposti b’funzjoni ta’ karbossiammid; komposti b’funzjoni ta’ ammid tal-aċidu karboniku',
    'Carboxyimide-function compounds (including saccharin and its salts) and imine-function compounds' => 'Komposti b’funzjoni ta’ karbossimmida (inkluż sakkarina u l-imlieħ tagħha) u komposti b’funzjoni ta’ immina',
    'Nitrile-function compounds' => 'Komposti b’funzjoni ta’ nitril',
    'Compounds with other nitrogen function' => 'Komposti b’funzjoni oħra ta’ nitroġenu',
    'Organo-sulphur compounds' => 'Komposti organiċi tal-kubrit',
    'Other organo-inorganic compounds' => 'Komposti organo-inorganiċi oħrajn',
    'Heterocyclic compounds with oxygen hetero-atom(s) only' => 'Komposti eteroċikliċi b’eteroatomu(i) tal-ossiġenu biss',
    'Heterocyclic compounds with nitrogen hetero-atom(s) only' => 'Komposti eteroċikliċi b’eteroatomu/i tan-nitroġenu biss',
    'Nucleic acids and their salts, whether or not chemically defined; other heterocyclic compounds' => 'Aċidi nuklejċi u l-imlieħ tagħhom, kemm jekk definiti kimikament u kemm jekk le; komposti eteroċikliċi oħrajn',
    'Sulphonamides' => 'Sulfonammidi',
    'Provitamins and vitamins, natural or reproduced by synthesis (including natural concentrates), derivatives thereof used primarily as vitamins, and intermixtures of the foregoing, whether or not in any solvent' => 'Provitamini u vitamini, naturali jew riprodotti b’sinteżi (inkluż konċentrati naturali), derivattivi tagħhom użati primarjament bħala vitamini, u taħlitiet imħalltin bejn dawn ta’ hawn fuq, kemm jekk fi kwalunkwe solvent u kemm jekk le',
    'Hormones, prostaglandins, thromboxanes and leukotrienes, natural or reproduced by synthesis; derivatives and structural analogues thereof, including chain modified polypeptides, used primarily as hormones' => 'Ormoni, prostaglandini, trombossani u lewkotrieni, naturali jew riprodotti b’sinteżi; derivattivi u analogi strutturali tagħhom, inkluż polipeptidi bil-katina modifikata, użati primarjament bħala ormoni',
    'Glycosides, natural or reproduced by synthesis, and their salts, ethers, esters and other derivatives' => 'Glikosidi, naturali jew riprodotti b’sinteżi, u mlieħ, eteri, esteri u derivattivi oħrajn tagħhom',
    'Alkaloids, natural or reproduced by synthesis, and their salts, ethers, esters and other derivatives' => 'Alkalojdi, naturali jew riprodotti b’sinteżi, u l-imlieħ, eteri, esteri u derivattivi oħrajn tagħhom',
    'Antibiotics' => 'Antibijotiċi',
    'Glands and other organs for organo-therapeutic uses, dried, whether or not powdered; extracts of glands or other organs or of their secretions for organo-therapeutic uses; heparin and its salts; other human or animal substances prepared for therapeutic or prophylactic uses, not elsewhere specified or included' => 'Glandoli u organi oħrajn għall-użi organo-terapewtiċi, imnixxfin, kemm jekk magħmulin trab u kemm jekk le; estratti tal-glandoli jew ta’ organi oħrajn jew tas-sekrezzjonijiet tagħhom għal-użi organo-terapewtiċi; eparina u l-imlieħ tagħha; sustanzi umani jew annimali oħrajn ippreparati għall-użi terapewtiċi jew profilattiċi, li mhumiex speċifikati jew inklużi banda oħra',
    'Human blood; animal blood prepared for therapeutic, prophylactic or diagnostic uses; antisera, other blood fractions and immunological products, whether or not modified or obtained by means of biotechnological processes; vaccines, toxins, cultures of micro-organisms (excluding yeasts) and similar products; cell cultures, whether or not modified' => 'Demm uman; demm tal-annimali ppreparat għall-użi terapewtiċi, profilattiċi jew dijanjostiċi; antiseri, frazzjonijiet oħrajn tad-demm u prodotti immunoloġiċi, kemm jekk modifikati jew miksubin permezz ta’ proċessi bijoteknoloġiċi u kemm jekk le; vaċċini, tossini, kolturi tal-mikroorganiżmi (ħlief il-ħmira) u prodotti simili; kolturi taċ-ċelloli, kemm jekk immodifikati u kemm jekk le',
    'Medicaments (excluding goods of heading 3002, 3005 or 3006) consisting of two or more constituents which have been mixed together for therapeutic or prophylactic uses, not put up in measured doses or in forms or packings for retail sale' => 'Medikamenti (ħlief l-oġġetti tal-intestatura 3002, 3005 jew 3006) li jikkonsistu f’żewġ kostitwenti jew iktar li tħalltu flimkien għall-użi terapewtiċi jew profilattiċi, mhux ippreżentati f’dożi mkejla jew f’forom jew f’pakki għall-bejgħ bl-imnut',
    'Medicaments (excluding goods of heading 3002, 3005 or 3006) consisting of mixed or unmixed products for therapeutic or prophylactic uses, put up in measured doses (including those in the form of transdermal administration systems) or in forms or packings for retail sale' => 'Medikamenti (ħlief l-oġġetti tal-intestatura 3002, 3005 jew3006) li jikkonsistu fi prodotti mħalltin jew mhux imħalltin għall-użi terapewtiċi jew profilattiċi, ippreżentati f’dożi mkejla (inkluż dawk f’forma ta’ sistemi ta’ somministrazzjoni transdermali) jew f’forom jew f’pakki għall-bejgħ bl-imnut',
    'Wadding, gauze, bandages and similar articles (for example, dressings, adhesive plasters, poultices), impregnated or coated with pharmaceutical substances or put up in forms or packings for retail sale for medical, surgical, dental or veterinary purposes' => 'Wattiet, garżi, faxex u oġġetti simili (eż. dressings, stikks, ġbajjar), imprenjati jew miksijin b’sustanzi farmaċewtiċi jew ippreżentati f’forom jew f’pakki għall-bejgħ bl-imnut għall-finijiet mediċi, kirurġiċi, dentali jew veterinarji',
    'Pharmaceutical goods specified in note 4 to this chapter' => 'Oġġetti farmaċewtiċi speċifikati fin-Nota 4 ta’ dan il-kapitolu',
    'Mineral or chemical fertilisers, nitrogenous' => 'Fertilizzanti minerali jew kimiċi, nitroġeniċi',
    'Mineral or chemical fertilisers, phosphatic' => 'Fertilizzanti minerali jew kimiċi, fosfatiċi',
    'Mineral or chemical fertilisers, potassic' => 'Fertilizzanti minerali jew kimiċi, potassiċi',
    'Mineral or chemical fertilisers containing two or three of the fertilising elements nitrogen, phosphorus and potassium; other fertilisers; goods of this chapter in tablets or similar forms or in packages of a gross weight not exceeding 10 kg' => 'Fertilizzanti minerali jew kimiċi li jkun fihom tnejn jew tlieta mill-elementi fertilizzanti nitroġenu, fosforu u potassju; fertilizzanti oħrajn; oġġetti ta’ dan il-kapitolu f’forma ta’ pilloli jew forom simili jew f’pakketti ta’ piż gross li ma jaqbiżx l-10 kg',
    'Tanning extracts of vegetable origin; tannins and their salts, ethers, esters and other derivatives' => 'Estratti għall-ikkonzar ta’ oriġini veġetali; tannini u mlieħ, eteri, esteri tagħhom u derivattivi oħrajn',
    'Synthetic organic tanning substances; inorganic tanning substances; tanning preparations, whether or not containing natural tanning substances; enzymatic preparations for pre-tanning' => 'Sustanzi organiċi sintetiċi għall-ikkonzar; sustanzi inorganiċi għall-ikkonzar; preparati għall-ikkonzar, kemm jekk ikun fihom sustanzi naturali għall-ikkonzar u kemm jekk le; preparati enżimatiċi għal qabel l-ikkonzar',
    'Colouring matter of vegetable or animal origin (including dyeing extracts but excluding animal black), whether or not chemically defined; preparations as specified in note 3 to this chapter based on colouring matter of vegetable or animal origin' => 'Materja koloranti ta’ oriġini veġetali jew annimali (inkluż l-estratti taż-żbigħ iżda eskluż l-iswed ta’ oriġini annimali), kemm jekk definita kimikament u kemm jekk le; preparati kif speċifikat fin-nota 3 ta’ dan il-kapitolu bbażati fuq materja koloranti ta’ oriġini veġetali jew annimali',
    'Synthetic organic colouring matter, whether or not chemically defined; preparations as specified in note 3 to this chapter based on synthetic organic colouring matter; synthetic organic products of a kind used as fluorescent brightening agents or as luminophores, whether or not chemically defined' => 'Materja koloranti organika sintetika, kemm jekk definita kimikament u kemm jekk le; preparati kif speċifikati fin-nota 3 ta’ dan il-kapitolu bbażati fuq materja koloranti organika sintetika; prodotti organiċi sintetiċi li jintużaw bħala aġenti brillaturi fluworexxenti jew bħala luminofori, kemm jekk definiti kimikament u kemm jekk le',
    'Other colouring matter; preparations as specified in note 3 to this chapter, other than those of heading 3203, 3204 or 3205; inorganic products of a kind used as luminophores, whether or not chemically defined' => 'Materja koloranti oħra; preparati kif speċifikati fin-nota 3 ta’ dan il-kapitolu, għajr dawk tal-intestatura 3203, 3204 jew 3205; prodotti inorganiċi li jintużaw bħala luminofori, kemm jekk definiti kimikament u kemm jekk le',
    'Prepared pigments, prepared opacifiers and prepared colours, vitrifiable enamels and glazes, engobes (slips), liquid lustres and similar preparations, of a kind used in the ceramic, enamelling or glass industry; glass frit and other glass, in the form of powder, granules or flakes' => 'Pigmenti ppreparati, opaċifikaturi ppreparati u kuluri ppreparati, enamels u glejżijiet vitrifikabbli, engobes (ħalib), lostri likwidi u preparati simili, li jintużaw fl-industrija taċ-ċeramika, tal-enamel jew tal-ħġieġ; fritta tal-ħġieġ u ħġieġ ieħor, fil-forma ta’ trab, granuli jew fjokki',
    'Paints and varnishes (including enamels and lacquers) based on synthetic polymers or chemically modified natural polymers, dispersed or dissolved in a non-aqueous medium; solutions as defined in note 4 to this chapter' => 'Żebgħat u verniċi (inkluż enamels u lacquers) ibbażati fuq polimeri sintetiċi jew il-polimeri naturali modifikati kimikament, dispersi jew dissolti f’medium mhux milwiem; soluzzjonijiet kif spjegati fin-nota 4 ta’ dan il-kapitolu',
    'Paints and varnishes (including enamels and lacquers) based on synthetic polymers or chemically modified natural polymers, dispersed or dissolved in an aqueous medium' => 'Żebgħat u verniċi (inkluż enamels u lacquers) ibbażati fuq polimeri sintetiċi jew polimeri naturali modifikati kimikament, dispersi jew dissolti f’medium milwiem',
    'Other paints and varnishes (including enamels, lacquers and distempers); prepared water pigments of a kind used for finishing leather' => 'Żebgħat u verniċi oħrajn (inkluż enamels, lacquers u distempers); pigmenti tal-ilma ppreparati li jintużaw għall-finitura tal-ġilda',
    'Pigments (including metallic powders and flakes) dispersed in non-aqueous media, in liquid or paste form, of a kind used in the manufacture of paints (including enamels); stamping foils; dyes and other colouring matter put up in forms or packings for retail sale' => 'Pigmenti (inkluz trab u fjokki metalliċi) dispersi f’media mhux milwiema, fil-forma likwida jew ta’ paste, li jintużaw fil-manifattura taż-żebgħat (inkluż enamels); fojls tal-istampar; żebgħat u materja koloranti oħra ppreżentati f’forom jew f’pakki għall-bejgħ bl-imnut',
    'Artists\', students\' or signboard painters\' colours, modifying tints, amusement colours and the like, in tablets, tubes, jars, bottles, pans or in similar forms or packings' => 'Kuluri tal-pitturi, tal-istudenti jew taż-żebbiegħa tat-tabelli, sfumaturi li jimmodifikaw, ilwien tad-divertiment u bħalhom, f’forma ta’ tablets, stoċċijiet, vażetti, fliexken, dixxijiet jew f’forom jew f’pakki simili',
    'Glaziers\' putty, grafting putty, resin cements, caulking compounds and other mastics; painters\' fillings; non-refractory surfacing preparations for façades, indoor walls, floors, ceilings or the like' => 'Stokk tal-vitrar, stokk tat-tilqim, simenti tar-raża, komposti tat-tqalfit u mastiċi oħrajn; mili taż-żebbiegħa; preparati tal-kisi mhux rifrattivi għall-faċċati, għall-ħitan interni, għall-artijiet, għas-soqfa u bħalhom',
    'Printing ink, writing or drawing ink and other inks, whether or not concentrated or solid' => 'Linka tal-istampar, linka għall-kitba jew għat-tpinġija u linek oħrajn, kemm jekk ikkonċentrati jew solidi u kemm jekk le',
    'Essential oils (terpeneless or not), including concretes and absolutes; resinoids; extracted oleoresins; concentrates of essential oils in fats, in fixed oils, in waxes or the like, obtained by enfleurage or maceration; terpenic by-products of the deterpenation of essential oils; aqueous distillates and aqueous solutions of essential oils' => 'Żjut essenzjali (kemm jekk bla terpeni u kemm jekk le), inkluż essenzi konkreti u essenzi assoluti; reżinojdi; oleorażi estratti; konċentrati taż-żjut essenzjali fix-xaħmijiet, fiż-żjut fissi, fix-xemgħa jew bħalhom, magħmulin permezz tal-enfleurage jew tal-inqigħ; prodotti sekondarji terpeniċi tad-deterpenazzjoni taż-żjut essenzjali; distillati milwiema u soluzzjonijiet milwiema taż-żjut essenzjali',
    'Mixtures of odoriferous substances and mixtures (including alcoholic solutions) with a basis of one or more of these substances, of a kind used as raw materials in industry; other preparations based on odoriferous substances, of a kind used for the manufacture of beverages' => 'Taħlitiet tas-sustanzi bir-riħa u t-taħlitiet (inkluż soluzzjonijiet alkoħoliċi) b’bażi ta’ waħda jew iktar minn dawn is-sustanzi, li jintużaw bħala materja prima fl-industrija; preparati oħrajn ibbażati fuq sustanzi bir-riħa, li jintużaw għall-manifattura tax-xarbiet',
    'Perfumes and toilet waters' => 'Fwejjaħ jew eaux de toilette',
    'Beauty or make-up preparations and preparations for the care of the skin (other than medicaments), including sunscreen or suntan preparations; manicure or pedicure preparations' => 'Preparati tas-sbuħija jew tal-make-up u preparati għall-kura tal-ġilda (għajr medikamenti), inkluż preparati għall-protezzjoni mix-xemx jew għas-smura tal-ġilda bix-xemx; preparati għall-manicure u għall-pedicure',
    'Preparations for use on the hair' => 'Preparati għal użu fuq ix-xagħar',
    'Preparations for oral or dental hygiene, including denture fixative pastes and powders; yarn used to clean between the teeth (dental floss), in individual retail packages' => 'Preparati għall-iġjene tal-ħalq u tas-snien, inkluż pastes u trabijiet għat-twaħħil tad-dentaturi; raden għat-tindif bejn is-snien (dental floss), f’pakketti individwali għall-bejgħ bl-imnut',
    'Pre-shave, shaving or aftershave preparations, personal deodorants, bath preparations, depilatories and other perfumery, cosmetic or toilet preparations, not elsewhere specified or included; prepared room deodorisers, whether or not perfumed or having disinfectant properties' => 'Preparati għal qabel, waqt jew wara t-tqaxxir tal-leħja, id-deodoranti personali, il-preparati għall-banju, id-depilatorji u preparati tal-fwejjaħ, kożmetiċi jew tat-twaletta oħrajn, mhux speċifikati jew inklużi banda oħra; deodorizzanti ppreparati għall-kmamar, kemm jekk ikunu mfewħin jew bi proprjetajiet diżinfettanti u kemm jekk le',
    'Soap; organic surface-active products and preparations for use as soap, in the form of bars, cakes, moulded pieces or shapes, whether or not containing soap; organic surface-active products and preparations for washing the skin, in the form of liquid or cream and put up for retail sale, whether or not containing soap; paper, wadding, felt and nonwovens, impregnated, coated or covered with soap or detergent' => 'Sapun; prodotti tensjoattivi organiċi u preparati għall-użu bħala sapun, fil-forma ta’ sapuna jew biċċiet iffurmati, kemm jekk ikun fihom is-sapun u kemm jekk le; prodotti tensjoattivi organiċi u preparati għall-ħasil tal-ġilda, fil-forma ta’ likwidu jew krema u ppreżentati għall-bejgħ bl-imnut, kemm jekk ikun fihom is-sapun u kemm jekk le; karti, wattiet, feltri u d-drappijiet mhux minsuġin, imprenjati, miksijin jew mgħottijin bis-sapun jew bid-deterġent',
    'Organic surface-active agents (other than soap); surface-active preparations, washing preparations (including auxiliary washing preparations) and cleaning preparations, whether or not containing soap, other than those of heading 3401' => 'Aġenti tensjoattivi organiċi (għajr is-sapun); preparati tensjoattivi, preparati għall-ħasil (inkluż preparati awżiljarji għall-ħasil) u preparati għat-tindif, kemm jekk ikun fihom is-sapun u kemm jekk le, għajr dawk tal-intestatura 3401',
    'Lubricating preparations (including cutting-oil preparations, bolt or nut release preparations, anti-rust or anti-corrosion preparations and mould-release preparations, based on lubricants) and preparations of a kind used for the oil or grease treatment of textile materials, leather, furskins or other materials, but excluding preparations containing, as basic constituents, 70 % or more by weight of petroleum oils or of oils obtained from bituminous minerals' => 'Preparati għal-lubrikazzjoni (inkluż preparati taż-żejt għall-qtugħ, preparati biex jerħu l-boltijiet u l-iskorfini, preparati kontra s-sadid jew kontra l-korrużjoni u preparati għall-qligħ mill-forom, ibbażati fuq lubrikanti) u preparati li jintużaw għat-trattament biż-żejt jew bil-griż tal-materjali tessili, tal-ġilda, tal-ġlud tal-pelliċċerija jew materjali oħrajn, iżda eskluż preparati li fihom, bħala kostitwenti bażiċi, 70 % jew iktar skont il-piż ta’ żjut tal-petroleum jew ta’ żjut miksubin minn minerali bituminużi',
