    'Gelatin (including gelatin in rectangular (including square) sheets, whether or not surface-worked or coloured) and gelatin derivatives; isinglass; other glues of animal origin, excluding casein glues of heading 3501' => 'Ġelatina (inkluż ġelatina f’folji rettangolari (inklużi kwadri), kemm jekk bis-superfiċje maħduma jew ikkulurita u kemm jekk le) u derivattivi tal-ġelatina; isinglass; kolol oħrajn li ġejjin mill-annimali, ħlief kolol tal-kaseina tal-intestatura 3501',
    'Peptones and their derivatives; other protein substances and their derivatives, not elsewhere specified or included; hide powder, whether or not chromed' => 'Peptoni u derivattivi tagħhom; sustanzi oħrajn tal-proteini u derivattivi tagħhom, li mhumiex speċifikati jew inklużi banda oħra; trab għall-ġild, kemm jekk ikun kromat u kemm jekk le',
