    'Prepared glues and other prepared adhesives, not elsewhere specified or included; products suitable for use as glues or adhesives, put up for retail sale as glues or adhesives, not exceeding a net weight of 1 kg' => 'Kolol ippreparati u adeżivi ppreparati oħrajn, li mhumiex speċifikati jew inklużi banda oħra; prodotti tajbin għall-użu bħala kolol jew adeżivi, ippreżentati għall-bejgħ bl-imnut bħala kolol jew adeżivi, li ma jaqbżux il-piż nett ta’ 1 kg',
