    'Refractory cements, mortars, concretes and similar compositions, including dolomite ramming mix, other than products of heading 3801' => 'Is-simenti refrattarji, it-tajn tal-bini, il-konkos u kompożizzjonijiet simili, inkluż it-taħlita għat-tablit tad-dolomit, għajr il-prodotti tal-intestatura 3801',
