    'Mixtures containing halogenated derivatives of methane, ethane or propane, not elsewhere specified or included' => 'It-taħlitiet li fihom id-derivattivi aloġenati tal-metan, tal-etan jew tal-propan, mhux speċifikati jew inklużi banda oħra',
