    'Compounded rubber, unvulcanised, in primary forms or in plates, sheets or strip' => 'Lastiku kompost, mhux vulkanizzat, fil-forom primarji jew fi pjanċi, folji jew strixxi',
    'Other forms (for example, rods, tubes and profile shapes) and articles (for example, discs and rings), of unvulcanised rubber' => 'Forom oħrajn (eż. vireg, tubi u forom profilati) u oġġetti (eż. diski u ċrieki), tal-lastiku mhux vulkanizzat',
    'Plates, sheets, strip, rods and profile shapes, of vulcanised rubber other than hard rubber' => 'Pjanċi, folji, vireg u forom profilati, tal-lastiku vulkanizzat għajr lastiku iebes',
    'Tubes, pipes and hoses, of vulcanised rubber other than hard rubber, with or without their fittings (for example, joints, elbows, flanges)' => 'Tubi, pajpijiet u pajpijiet flessibbli tal-lastiku vulkanizzat għajr lastiku iebes, kemm jekk bil-fittings tagħhom (eż. ġonot, elbows, flanġijiet) u kemm jekk le',
    'Conveyor or transmission belts or belting, of vulcanised rubber' => 'Conveyor belts u belts tat-trażmissjoni jew conveyor belting u belting tat-trażmissjoni, tal-lastiku vulkanizzat',
    'New pneumatic tyres, of rubber' => 'Tajers pnewmatiċi ġodda, tal-lastiku',
    'Retreaded or used pneumatic tyres of rubber; solid or cushion tyres, tyre treads and tyre flaps, of rubber' => 'Tajers pnewmatiċi tal-lastiku riġenerati jew użati; tajers solidi jew kuxin, l-uċuħ tat-tajers u l-flaps tat-tajers, tal-lastiku',
    'Inner tubes, of rubber' => 'Tubi ta’ ġewwa, tal-lastiku',
    'Hygienic or pharmaceutical articles (including teats), of vulcanised rubber other than hard rubber, with or without fittings of hard rubber' => 'Oġġetti iġjeniċi jew farmaċewtiċi (inkluż gażażi), tal-lastiku vulkanizzat għajr lastiku iebes, kemm jekk ikollhom fittings tal-lastiku iebes u kemm jekk le',
    'Articles of apparel and clothing accessories (including gloves, mittens and mitts), for all purposes, of vulcanised rubber other than hard rubber' => 'Oġġetti tal-ilbies u aċċessorji tal-ħwejjeġ (inkluż ingwanti, mittens u moffoli) għall-finijiet kollha, tal-lastiku vulkanizzat għajr lastiku iebes',
    'Other articles of vulcanised rubber other than hard rubber' => 'Oġġetti oħrajn tal-lastiku vulkanizzat għajr lastiku iebes',
    'Raw hides and skins of bovine (including buffalo) or equine animals (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not dehaired or split' => 'Ġlud grezzi tal-annimali bovini (inkluż tal-buflu) jew ekwini (friski, jew immellħin, imnixxfin, ittrattati bil-ġir, piklati jew ippreservati b’mod ieħor, iżda mhux ikkonzati, ipparċminati jew ippreparati mod ieħor), kemm jekk imxerrħa jew bix-xagħar imneħħi kemm jekk le',
    'Raw skins of sheep or lambs (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not with wool on or split, other than those excluded by note 1(c) to this chapter' => 'Ġlud grezzi tan-nagħaġ jew tal-ħrief (friski, jew immellħin, imnixxfin, ittrattati bil-ġir, piklati jew ippreservati b’mod ieħor, iżda mhux ikkonzati, ipparċminati jew ippreparati mod ieħor), kemm dawk imġiżża, jew imxerrħa, kif ukoll dawk li mhumiex, għajr dawk esklużi bin-nota 1 (c) ta’ dan il-kapitolu',
    'Other raw hides and skins (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not dehaired or split, other than those excluded by note 1(b) or 1(c) to this chapter' => 'Ġlud grezzi oħrajn (friski, jew immellħin, imnixxfin, ittrattati bil-ġir, immarinati jew ippreservati b’mod ieħor, iżda mhux ikkonzati, ipparċminati jew ippreparati mod ieħor), kemm jekk imxerrħa jew bix-xagħar imneħħi kemm jekk le, għajr dawk esklużi bin-nota 1 (b) jew 1 (c) ta’ dan il-kapitolu',
    'Tanned or crust hides and skins of bovine (including buffalo) or equine animals, without hair on, whether or not split, but not further prepared' => 'Ġlud ikkonzati jew "in crust" tal-annimali bovini (inkluż tal-buflu) jew ekwini, imġiżża, kemm dawk imxerrħa kif ukoll dawk li mhumiex, iżda mhux ippreparati mod ieħor',
    'Tanned or crust skins of sheep or lambs, without wool on, whether or not split, but not further prepared' => 'Ġlud ikkonzati jew in crust tan-nagħaġ jew tal-ħrief, imġiżża, kemm imxerrħa kif ukoll le, iżda mhux ippreparati mod ieħor',
    'Tanned or crust hides and skins of other animals, without wool or hair on, whether or not split, but not further prepared' => 'Ġlud ikkonzati jew in crust ta’ annimali oħrajn, imġiżża, kemm dawk imxerrħa kif ukoll dawk li mhumiex, iżda mhux ippreparati mod ieħor',
    'Leather further prepared after tanning or crusting, including parchment-dressed leather, of bovine (including buffalo) or equine animals, without hair on, whether or not split, other than leather of heading 4114' => 'Ġilda li ngħatat iktar trattament wara l-ikkonzar u l-crusting, li tinkludi l-ġilda pparċminata, tal-annimali bovini (fosthom il-buflu) jew tal-ekwini, imġiżża, kemm dawk imxerrħa kif ukoll dawk li mhumiex, għajr il-ġilda tal-intestatura 4114',
    'Leather further prepared after tanning or crusting, including parchment-dressed leather, of other animals, without wool or hair on, whether or not split, other than leather of heading 4114' => 'Ġilda li ngħatat iktar trattament wara l-ikkonzar u l-crusting, li tinkludi l-ġilda pparċminata, ta’ annimali oħrajn, imġiżża, kemm jekk tkun imxerrħa kif ukoll jekk le, għajr il-ġilda tal-intestatura 4114',
    'Chamois (including combination chamois) leather; patent leather and patent laminated leather; metallised leather' => 'Ġilda tal-kamoxxa (anki l-kamoxx ikkombinat); ġilda tal-alakka u ġilda tal-alakka laminata; ġilda metallizzata',
    'Composition leather with a basis of leather or leather fibre, in slabs, sheets or strip, whether or not in rolls; parings and other waste of leather or of composition leather, not suitable for the manufacture of leather articles; leather dust, powder and flour' => 'Ġilda rikostitwita b’bażi tal-ġilda jew tal-fibra tal-ġilda, fil-forma, ta’ blokok, ta’ folji jew ta’ strixex, irrumblati jew le; qtugħ jew skart ieħor tal-ġilda jew tal-ġilda rikostitwita, mhux tajbin għall-manifattura ta’ oġġetti tal-ġilda; trab, terra u dqiq tal-ġilda',
    'Trunks, suitcases, vanity cases, executive-cases, briefcases, school satchels, spectacle cases, binocular cases, camera cases, musical instrument cases, gun cases, holsters and similar containers; travelling-bags, insulated food or beverages bags, toilet bags, rucksacks, handbags, shopping-bags, wallets, purses, map-cases, cigarette-cases, tobacco-pouches, tool bags, sports bags, bottle-cases, jewellery boxes, powder boxes, cutlery cases and similar containers, of leather or of composition leather, of sheeting of plastics, of textile materials, of vulcanised fibre or of paperboard, or wholly or mainly covered with such materials or with paper' => 'Bagolli, valiġġi, valiġetti għall-oġġetti tat-twaletta, valiġetti għad-dokumenti, basktijiet tal-iskola, cases għan-nuċċalijiet, cases għat-trombi, cases għall-kameras, cases għall-istrumenti mużikali, cases għall-ixkubetti, stoċċijiet tal-pistola u kontenituri simili; bagalji għas-safar, boroż iżolati għall-ikel jew għax-xarbiet, boroż tat-twaletta, barżakki, handbags, boroż tax-xiri, kartieri, portmonijiet, cases għall-mapep, kaxxetti għas-sigaretti, boroż tat-tabakk, boroż tal-għodda, boroż tal-isports, cases tal-fliexken, kaxex għall-ġojjellerija, kaxex tat-terra, cases tal-pożati u kontenituri bħalhom, tal-ġilda jew tal-ġilda rikostitwita, tal-folji tal-plastik, ta’ materjali tessili, ta’ fibra vulkanizzata jew tal-kartun, jew kollha jew prinċipalment miksijin b’dawn il-materjali jew bil-karta',
    'Articles of apparel and clothing accessories, of leather or of composition leather' => 'Oġġetti ta’ lbies u aċċessorji tal-ħwejjeġ, tal-ġilda jew tal-ġilda rikostitwita',
    'Other articles of leather or of composition leather' => 'Oġġetti oħrajn tal-ġilda jew tal-ġilda rikostitwita',
    'Raw furskins (including heads, tails, paws and other pieces or cuttings, suitable for furriers\' use), other than raw hides and skins of heading 4101, 4102 or 4103' => 'Ġlud tal-pelliċċerija grezzi (bl-irjus, bid-dnub, bis-saqajn u partijiet jew qatgħat oħrajn, tajbin biex jintużaw mill-pelliċċier), għajr il-ġlud grezzi u l-ġlud tal-intestaturi 4101, 4102 jew 4103',
    'Tanned or dressed furskins (including heads, tails, paws and other pieces or cuttings), unassembled, or assembled (without the addition of other materials) other than those of heading 4303' => 'Ġlud tal-pelliċċerija kkunzati jew imnaddfin (inkluż irjus, dnub, saqajn u partijiet jew qatgħat oħrajn), mhux assemblati, jew assemblati (mingħajr iż-żieda ta’ materjali oħrajn) għajr dawk tal-intestatura 4303',
    'Articles of apparel, clothing accessories and other articles of furskin' => 'Oġġetti ta’ ħwejjeġ, aċċessorji tal-ilbies u oġġetti oħrajn magħmulin mill-ġlud tal-pelliċċerija',
    'Fuel wood, in logs, in billets, in twigs, in faggots or in similar forms; wood in chips or particles; sawdust and wood waste and scrap, whether or not agglomerated in logs, briquettes, pellets or similar forms' => 'Qabs, fil-forma ta’ zkuk, qatgħat taz-zkuk, friegħi, qatet jew forom simili; injam f’laqx jew partikuli; serratura u skart u laqx tal-injam, kemm jekk agglomerati fil-forma ta’ zkuk, briquettes, pellets jew forom simili, kif ukoll jekk le',
    'Wood charcoal (including shell or nut charcoal), whether or not agglomerated' => 'Karbonju tal-injam (inkluż karbonju tal-qxur jew tal-ġewż), agglomerat jew le',
    'Wood in the rough, whether or not stripped of bark or sapwood, or roughly squared' => 'Injam grezz, kemm jekk bil-qoxra jew bl-ilbieba mneħħija jew le, jew maqtugħ kwadru raff',
    'Hoopwood; split poles; piles, pickets and stakes of wood, pointed but not sawn lengthwise; wooden sticks, roughly trimmed but not turned, bent or otherwise worked, suitable for the manufacture of walking sticks, umbrellas, tool handles or the like; chipwood and the like' => 'Injam għaċ-ċrieki; arbli mxerrħa; puntali, pali u bsaten tal-injam, bil-ponta iżda mhux issegati għat-tul; stikek tal-injam, mirqumin raff iżda mhux inturnjati, milwijin jew maħdumin mod ieħor, tajbin għall-manifattura tal-bsaten għall-mixi, umbrelel, mankijiet tal-għodod jew bħalhom; chipwood u simili',
    'Railway or tramway sleepers (cross-ties) of wood' => 'Traversi (cross-ties) tal-injam għal-linji tal-ferrovija jew tat-tramm',
    'Wood sawn or chipped lengthwise, sliced or peeled, whether or not planed, sanded or end-jointed, of a thickness exceeding 6 mm' => 'Injam issegat jew imlaqqax għat-tul, imfellel jew imqaxxar, inċanat jew le, xkatlat jew bit-truf ġonġuti, ta’ ħxuna li taqbeż is-6 mm',
    'Sheets for veneering (including those obtained by slicing laminated wood), for plywood or for similar laminated wood and other wood, sawn lengthwise, sliced or peeled, whether or not planed, sanded, spliced or end-jointed, of a thickness not exceeding 6 mm' => 'Folji għall-fuljetta (inkluż dawk magħmulin bit-tiflil tal-injam laminat), għall-plywood jew għal injam simili laminat u injam ieħor, issegat għat-tul, imfellel jew imqaxxar, inċanat, xkatlat, impalellat jew bit-truf ġonġuti, ta’ ħxuna li ma taqbiżx is-6 mm',
    'Wood (including strips and friezes for parquet flooring, not assembled) continuously shaped (tongued, grooved, rebated, chamfered, V-jointed, beaded, moulded, rounded or the like) along any of its edges, ends or faces, whether or not planed, sanded or end-jointed' => 'Injam (inkluż strixxi u freġji għall-kisi tal-art bil-parquet, mhux assemblati) iffurmat b’mod kontinwu (b’minċott raġel, b’minċott mara, b’ħanek maqtugħ, iċċanfrinat, bi skanalatura-V, bil-gula, iffurmat, ittundjat jew simili) tul kwalunkwe xifer, tarf jew wiċċ tiegħu, inċanat, xkatlat jew bit-truf ġonġuti jew le',
    'Particle board, oriented strand board (OSB) and similar board (for example, waferboard) of wood or other ligneous materials, whether or not agglomerated with resins or other organic binding substances' => 'Particle board, oriented strand board (OSB) u board simili (eż. waferboard) tal-injam jew ta’ materjali oħrajn mill-injam, kemm jekk agglomerati bir-rażi jew sustanzi leganti organiċi oħrajn u kemm jekk le',
    'Fibreboard of wood or other ligneous materials, whether or not bonded with resins or other organic substances' => 'Fibreboard tal-injam jew materjali oħrajn mill-injam, magħqudin bir-rażi jew b’sustanzi organiċi oħrajn jew le',
    'Plywood, veneered panels and similar laminated wood' => 'Plywood, pannelli miksijin bil-fuljetta u injam laminat bħalhom',
    'Wooden frames for paintings, photographs, mirrors or similar objects' => 'Gwarniċi tal-injam għal pitturi, ritratti, mirja u oġġetti simili',
    'Packing cases, boxes, crates, drums and similar packings, of wood; cable-drums of wood; pallets, box pallets and other load boards, of wood; pallet collars of wood' => 'Cases għall-ippakkjar, kaxxi, ċestuni, ċilindri u pakki simili; tal-injam; rombli tal-injam tal-kejbils; pallets, pallets tal-kaxxi u boards oħrajn tat-tagħbija, tal-injam; pallet collars tal-injam',
    'Builders\' joinery and carpentry of wood, including cellular wood panels, assembled flooring panels, shingles and shakes' => 'Xogħol tal-injam għall-bennejja, inkluż pannelli tal-injam ċellulari, pannelli assemblati għall-paviment, shingles u shakes',
    'Tableware and kitchenware, of wood' => 'Oġġetti tal-mejda u tal-kċina, tal-injam',
    'Wood marquetry and inlaid wood; caskets and cases for jewellery or cutlery, and similar articles, of wood; statuettes and other ornaments, of wood; wooden articles of furniture not falling in Chapter 94' => 'Intarsjar fl-injam u injam intarsjat; kaxxetti u cases għall-ġojjellerija jew għall-pożati, u oġġetti bħalhom, tal-injam; statwetti u ornamenti oħrajn, tal-injam; oġġetti tal-injam ta’ għamara li ma jaqgħux fil-Kapitolu 94',
    'Other articles of wood' => 'Oġġetti oħrajn tal-injam',
    'Natural cork, raw or simply prepared; waste cork; crushed, granulated or ground cork' => 'Sufra naturali, grezza jew sempliċement ippreparata; skart tas-sufra; sufra misħuqa, granulata jew immolata',
    'Articles of natural cork' => 'Oġġetti tas-sufra naturali',
    'Agglomerated cork (with or without a binding substance) and articles of agglomerated cork' => 'Sufra agglomerata (b’sustanza leganti jew le) u oġġetti tas-sufra agglomerata',
    'Plaits and similar products of plaiting materials, whether or not assembled into strips; plaiting materials, plaits and similar products of plaiting materials, bound together in parallel strands or woven, in sheet form, whether or not being finished articles (for example, mats, matting, screens)' => 'Dfur u prodotti simili tal-materjali tad-dfir, assemblati fi strixxi jew le; materjali tad-dfir, dfur u prodotti simili tal-materjali tad-dfir, marbutin flimkien fi swiegel paralleli jew minsuġa, f’forma ta’ folji, kemm jekk huma oġġetti rfinuti u kemm jekk le (eż. mats, materjal tal-ħsajjar jew paraventi)',
    'Basketwork, wickerwork and other articles, made directly to shape from plaiting materials or made up from goods of heading 4601; articles of loofah' => 'Xogħol tal-qfief, xogħol tal-qasab u oġġetti oħrajn, magħmulin direttament għall-forma minn materjali tad-dfir jew magħmulin minn oġġetti tal-intestatura 4601; oġġetti tal-lufa',
    'Mechanical wood pulp' => 'Polpa tal-injam mekkanika',
    'Chemical wood pulp, soda or sulphate, other than dissolving grades' => 'Polpa tal-injam kimika, soda jew sulfat, għajr ta’ gradi solubbli',
    'Chemical wood pulp, sulphite, other than dissolving grades' => 'Polpa tal-injam kimika, sulfit, għajr ta’ gradi solubbli',
    'Pulps of fibres derived from recovered (waste and scrap) paper or paperboard or of other fibrous cellulosic material' => 'Polpi ta’ fibri ġejjin minn (skart u laqx tal-) karta jew kartun irkuprat ta’ materjal ċellulożiku fibruż ieħor',
    'Recovered (waste and scrap) paper or paperboard' => '(Skart u laqx tal-) karta jew kartun irkuprat',
    'Uncoated paper and paperboard, of a kind used for writing, printing or other graphic purposes, and non-perforated punchcards and punch-tape paper, in rolls or rectangular (including square) sheets, of any size, other than paper of heading 4801 or 4803; handmade paper and paperboard' => 'Karta u kartun mhux miksijin, tat-tip użat għall-kitba, stampar jew finijiet grafiċi oħrajn, u kartun tal-ippanċjar u karta għat-tejp tal-ippanċjar mhux perforati, f’rombli jew folji rettangulari (inkluż kwadri), ta’ kwalunkwe qies, għajr karta tas-subintestatura 4801 jew 4803; karta jew kartun magħmulin bl-idejn',
    'Toilet or facial tissue stock, towel or napkin stock and similar paper of a kind used for household or sanitary purposes, cellulose wadding and webs of cellulose fibres, whether or not creped, crinkled, embossed, perforated, surface-coloured, surface-decorated or printed, in rolls or sheets' => 'Materjal lest biex minnu jsir tixju tat-toilet jew tal-wiċċ, materjal lest għax-xugamani jew srievet u karta simili tat-tip użata għal finijiet tad-dar jew sanitarji, wattiet taċ-ċelluloża u nsiġ ta’ fibri taċ-ċelluloża, imġegħdin (creped) jew le, imkemmxin, intaljati, perforati, bis-superfiċje kkulurita, bis-superfiċje mżejna jew stampata, f’rombli jew folji',
    'Uncoated kraft paper and paperboard, in rolls or sheets, other than that of heading 4802 or 4803' => 'Karta jew kartun kraft mhux miksi, f’rombli jew folji, għajr dawk tas-subintestatura 4802 jew 4803',
    'Other uncoated paper and paperboard, in rolls or sheets, not further worked or processed than as specified in note 3 to this chapter' => 'Karta jew kartun oħrajn mhux miksi, f’rombli jew folji, mhux maħdumin jew ipproċessati iktar minn kif speċifikat fin-nota 3 ta’ dan il-kapitolu',
    'Vegetable parchment, greaseproof papers, tracing papers and glassine and other glazed transparent or translucent papers, in rolls or sheets' => 'Parċmina veġetali, kartastrazza, karti għat-traċċar u karti jleqqu (glassine) u karti oħrajn igglejżjati trasparenti jew trasluċidi, f’rombli jew folji',
    'Composite paper and paperboard (made by sticking flat layers of paper or paperboard together with an adhesive), not surface-coated or impregnated, whether or not internally reinforced, in rolls or sheets' => 'Karta u kartun imħalltin (magħmulin billi jitwaħħlu saffi ċatti ta’ karta jew kartun flimkien b’kolla), mhux bis-superfiċje miksija jew imprenjati, kemm jekk mirfudin minn ġewwa jew le, f’rombli jew folji',
    'Paper and paperboard, corrugated (with or without glued flat surface sheets), creped, crinkled, embossed or perforated, in rolls or sheets, other than paper of the kind described in heading 4803' => 'Karta u kartun, ikkorrugati (b’folji ċatti nkullati fis-superfiċje jew mingħajrhom), imġegħdin, imkemmxin, intaljati jew perforati, f’rombli jew folji, għajr karta tat-tip deskritt fis-subintestatura 4803',
    'Carbon paper, self-copy paper and other copying or transfer papers (including coated or impregnated paper for duplicator stencils or offset plates), whether or not printed, in rolls or sheets' => 'Karta saħħara, karta li tikkopja minnha nnifisha u karti għal ikkupjar jew transfers oħrajn (inkluż karta miksija jew imprenjata għal stensils duplikaturi jew pjanċi tal-offset), stampati jew le, f’rombli jew folji',
    'Paper and paperboard, coated on one or both sides with kaolin (China clay) or other inorganic substances, with or without a binder, and with no other coating, whether or not surface-coloured, surface-decorated or printed, in rolls or rectangular (including square) sheets, of any size' => 'Karta u kartun, miksijin min-naħa waħda jew miż-żewġ naħat bil-kawlina (tafal taċ-Ċina) jew sustanzi oħrajn inorganiċi, b’legant jew le, u mingħajr ebda kisja oħra, bis-superfiċje kkulurita, bis-superfiċje imżejna jew stampata f’rombli jew folji rettangulari (inkluż kwadri) jew le, ta’ kwalunkwe qies',
    'Paper, paperboard, cellulose wadding and webs of cellulose fibres, coated, impregnated, covered, surface-coloured, surface-decorated or printed, in rolls or rectangular (including square) sheets, of any size, other than goods of the kind described in heading 4803, 4809 or 4810' => 'Karta, kartun, wattiet taċ-ċelluloża u nsiġ ta’ fibri taċ-ċelluloża, miksijin, imprenjati, mgħottijin, bis-superfiċje kkulurita, bis-superfiċje mżejna jew stampata, f’rombli jew folji rettangulari (inkluż kwadri), ta’ kwalunkwe qies, għajr oġġetti tat-tip deskritt fis-subintestaturi 4803, 4809 jew 4810',
    'Cigarette paper, whether or not cut to size or in the form of booklets or tubes' => 'Karta tas-sigaretti, maqtugħa għal qies jew le jew f’forma ta’ libretti jew tubi',
    'Wallpaper and similar wallcoverings; window transparencies of paper' => 'Wallpaper u kisi tal-ħitan simili; trasparenzi tal-karta għat-l-twieqi',
