    'Other tubes, pipes and hollow profiles (for example, open seam or welded, riveted or similarly closed), of iron or steel' => 'Tubi, pajpijiet u profili vojta oħrajn (eż. bil-ġonta miftuħa jew iwweldjati, irrivitjati jew magħluqin b’mod simili), tal-ħadid jew tal-azzar',
