    'Structures (excluding prefabricated buildings of heading 9406) and parts of structures (for example, bridges and bridge-sections, lock-gates, towers, lattice masts, roofs, roofing frameworks, doors and windows and their frames and thresholds for doors, shutters, balustrades, pillars and columns), of iron or steel; plates, rods, angles, shapes, sections, tubes and the like, prepared for use in structures, of iron or steel' => 'Strutturi (ħlief bini prefabbrikat tal-intestatura 9406) u parts ta’ strutturi (eż. pontijiet u qatgħat ta’ pontijiet, xtiebi tal-mgħalaq (lock-gates), torrijiet, arbli kannizzata, soqfa, oqfsa għal tisqif, bibien u twieqi u l-gwarniċi tagħhom u għetiebi għal bibien, shutters, balavostri, pilastri u kolonni), tal-ħadid jew tal-azzar; pjanċi, vireg, angoli, forom, sezzjonijiet, tubi u bħalhom, ippreparati għal użu fi strutturi, tal-ħadid jew tal-azzar',
    'Reservoirs, tanks, vats and similar containers for any material (other than compressed or liquefied gas), of iron or steel, of a capacity exceeding 300 l, whether or not lined or heat-insulated, but not fitted with mechanical or thermal equipment' => 'Reservoirs, tankijiet, btieti u kontenituri simili għal kwalunkwe materjal (għajr għal gass ikkompressat jew illikwifikat), tal-ħadid jew tal-azzar, ta’ kapaċità li taqbeż it-300 l, infurrati jew iżolati għas-sħana jew le, iżda mhux mgħammrin b’tagħmir mekkaniku jew termali',
    'Tanks, casks, drums, cans, boxes and similar containers, for any material (other than compressed or liquefied gas), of iron or steel, of a capacity not exceeding 300 l, whether or not lined or heat-insulated, but not fitted with mechanical or thermal equipment' => 'Tankijiet, btieti, ċilindri, laned, kaxxi u kontenituri simili, għal kwalunkwe materjal (għajr gass ikkompressat jew illikwifikat), tal-ħadid jew tal-azzar, b’kapaċità li ma taqbiżx 300 l, infurrati jew iżolati għas-sħana jew le, iżda mhux mgħammrin b’tagħmir mekkaniku jew termali',
    'Containers for compressed or liquefied gas, of iron or steel' => 'Kontenituri għal gass ikkompressat jew illikwifikat, tal-ħadid jew tal-azzar',
    'Stranded wire, ropes, cables, plaited bands, slings and the like, of iron or steel, not electrically insulated' => 'Wajer bis-swiegel, ħbula, gumna, ċineg immaljati, bragi u bħalhom, tal-ħadid jew tal-azzar, mhux iżolat għall-elettriku',
    'Cloth (including endless bands), grill, netting and fencing, of iron or steel wire; expanded metal of iron or steel' => 'Drapp (inkluż ċineg bla tarf), grilja, xbieki u reċinti, ta’ wajer tal-ħadid jew tal-azzar; metall espandut tal-ħadid jew tal-azzar',
    'Chain and parts thereof, of iron or steel' => 'Ktajjen u parts tagħhom, tal-ħadid jew tal-azzar',
    'Nails, tacks, drawing pins, corrugated nails, staples (other than those of heading 8305) and similar articles, of iron or steel, whether or not with heads of other material, but excluding such articles with heads of copper' => 'Imsiemer, taċċi, drawing pins, imsiemer ikkorrugati, staples (għajr dawk tal-intestatura 8305) u oġġetti simili, tal-ħadid jew tal-azzar, bl-irjus ta’ materjal ieħor jew le, iżda, esklużi tali oġġetti bi rjus tar-ram',
    'Screws, bolts, nuts, coach screws, screw hooks, rivets, cotters, cotter pins, washers (including spring washers) and similar articles, of iron or steel' => 'Viti, boltijiet, skorfini, viti bir-ras skorfina (coach screws), ganċijiet bil-kamin, rivets, kavilji, ċavi, washers (inkluż l-ispring washers) u oġġetti simili, tal-ħadid jew tal-azzar',
    'Sewing needles, knitting needles, bodkins, crochet hooks, embroidery stilettos and similar articles, for use in the hand, of iron or steel; safety pins and other pins of iron or steel, not elsewhere specified or included' => 'Labar tal-ħjata, labar tan-innittjar, imsell (bodkins), ganċijiet tal-crochet, labar stiletto tar-rakkmu u oġġetti simili, għall-użu bl-idejn, tal-ħadid jew tal-azzar; labar tas-sarwan u labar oħrajn tal-ħadid jew tal-azzar, mhux speċifikati jew inkluż banda oħra',
    'Springs and leaves for springs, of iron or steel' => 'Molol u strixxi għal molol, tal-ħadid jew tal-azzar',
    'Stoves, ranges, grates, cookers (including those with subsidiary boilers for central heating), barbecues, braziers, gas rings, plate warmers and similar non-electric domestic appliances, and parts thereof, of iron or steel' => 'Stufi, ranges, gradilji, cookers (inkluż dawk b’boilers sussidjarji għal tisħin ċentrali), barbecues, braċieri, ċrieki tal-gass, apparat għat-tisħin tal-platti u apparat simili tad-dar mhux tal-elettriku, u parts tagħhom, tal-ħadid jew tal-azzar',
    'Radiators for central heating, not electrically heated, and parts thereof, of iron or steel; air heaters and hot-air distributors (including distributors which can also distribute fresh or conditioned air), not electrically heated, incorporating a motor-driven fan or blower, and parts thereof, of iron or steel' => 'Radjaturi għat-tisħin ċentrali, mhux imsaħħnin bl-elettriku, u parts tagħhom, tal-ħadid jew tal-azzar; heaters tal-arja u distributuri tal-arja sħuna (inkluż distributuri li jistgħu jqassmu wkoll arja friska jew kundizzjonata), mhux imsaħħnin bl-elettriku, li fihom fann jew blower imħaddmin b’mutur, u l-parts tagħhom, tal-ħadid jew tal-azzar',
    'Table, kitchen or other household articles and parts thereof, of iron or steel; iron or steel wool; pot scourers and scouring or polishing pads, gloves and the like, of iron or steel' => 'Oġġetti tal-mejda, tal-kċina jew oġġetti oħrajn tad-dar u parts tagħhom, tal-ħadid u tal-azzar; suf tal-ħadid jew tal-azzar; barraxi għall-borom u pads jew ingwanti għall-għorik jew għall-illustrar u bħalhom, tal-ħadid jew tal-azzar',
    'Sanitary ware and parts thereof, of iron or steel' => 'Oġġetti għall-kamra tal-banju u parts tagħhom, tal-ħadid jew tal-azzar',
