    'Table, kitchen or other household articles and parts thereof, of copper; pot scourers and scouring or polishing pads, gloves and the like, of copper; sanitary ware and parts thereof, of copper' => 'Oġġetti tal-mejda, tal-kċina jew oġġetti oħrajn tad-dar u parts tagħhom, tar-ram; barraxi għall-borom u pads jew ingwanti għall-għorik jew għall-illustrar u bħalhom, tar-ram; oġġetti għall-kamra tal-banju u parts tagħhom, tar-ram',
