    'Aluminium bars, rods and profiles' => 'Żbarri, vireg u profili tal-aluminju',
    'Aluminium wire' => 'Wajer tal-aluminju',
    'Aluminium plates, sheets and strip, of a thickness exceeding 0,2 mm' => 'Pjanċi, folji u strixxi tal-aluminju, eħxen minn 0,2 mm',
    'Aluminium foil (whether or not printed or backed with paper, paperboard, plastics or similar backing materials) of a thickness (excluding any backing) not exceeding 0,2 mm' => 'Fojl tal-aluminju (stampat jew miksi b’karta, kartonċin, plastik jew materjali simili ta’ rfid jew le) ta’ ħxuna (eskluż kwalunkwe rfid) mhux iktar minn 0,2 mm',
    'Aluminium tubes and pipes' => 'Tubi u pajpijiet tal-aluminju',
