    'Aluminium casks, drums, cans, boxes and similar containers (including rigid or collapsible tubular containers), for any material (other than compressed or liquefied gas), of a capacity not exceeding 300 litres, whether or not lined or heat-insulated, but not fitted with mechanical or thermal equipment' => 'Btieti, ċilindri, laned, kaxxi u kontenituri simili tal-aluminju (inkluż kontenituri tubulari riġidi jew kollassabbli), għal kwalunkwe materjal (għajr gass kompressat jew likwifikat), ta’ kapaċità li ma taqbiżx it-300 litru, infurrati jew insulati għas-sħana jew le, iżda mhux mgħammrin b’tagħmir mekkaniku jew termiku',
    'Stranded wire, cables, plaited bands and the like, of aluminium, not electrically insulated' => 'Wajer bis-swiegli, gumna, ċineg immaljati u bħalhom, tal-aluminju, mhux insulati għall-elettriku',
