    'Unwrought tin' => 'Landa mhux maħduma',
    'Other articles of tin' => 'Oġġetti oħrajn tal-landa',
    'Tungsten (wolfram) and articles thereof, including waste and scrap' => 'Tungstenu (wolfram) u oġġetti magħmula minnu, inkluż skart u skrapp',
