    'Cobalt mattes and other intermediate products of cobalt metallurgy; cobalt and articles thereof, including waste and scrap' => 'Matti tal-kobalt u prodotti oħrajn intermedji tal-metallurġija tal-kobalt; kobalt u oġġeti magħmulin minnu, inkluż skart u skrapp',
    'Bismuth and articles thereof, including waste and scrap' => 'Bismut u oġġeti magħmulin minnu, inkluż skart u skrapp',
    'Titanium and articles thereof, including waste and scrap' => 'Titanju u oġġeti magħmulin minnu, inkluż skart u skrapp',
    'Zirconium and articles thereof, including waste and scrap' => 'Żirkonju u oġġeti magħmulin minnu, inkluż skart u skrapp',
    'Antimony and articles thereof, including waste and scrap' => 'Antimonju u oġġetti magħmulin minnu, inkluż skart u skrapp',
    'Manganese and articles thereof, including waste and scrap' => 'Manganiż u oġġeti magħmulin minnu, inkluż skart u skrapp',
    'Beryllium, chromium, hafnium, rhenium, thallium, cadmium, germanium, vanadium, gallium, indium and niobium (columbium), and articles of these metals, including waste and scrap' => 'Berillju, kromu, afnju, renju tallju, kadmju, ġermanju, vanadju, gallju, indju u nijobju (kolombju), oġġetti magħmula minn dawn il-metalli, inkluż skart u skrapp',
    'Cermets and articles thereof, including waste and scrap' => 'Ċermiti u oġġetti tagħhom, inkluż skart u skrapp',
