    'Handsaws; blades for saws of all kinds (including slitting, slotting or toothless saw blades)' => 'Srieraq u segi tal-idejn; lami għal segi ta’ kull tip (inkluż lami għall-qtugħ u xfafar għall-friq)',
    'Files, rasps, pliers (including cutting pliers), pincers, tweezers, metal-cutting shears, pipe-cutters, bolt croppers, perforating punches and similar hand tools' => 'Limi, raspi, pliers (inkluż cutting pliers), tnalji, pinzetti, ġliem għall-metall, għodod għall-qtugħ ta’ pajpijiet, għodod għat-tqaċċit ta’ boltijiet, perforating punches u għodod tal-idejn simili',
    'Hand-operated spanners and wrenches (including torque meter wrenches but not including tap wrenches); interchangeable spanner sockets, with or without handles' => 'Spanners u wrenches tal-idejn (inkluż torque meter wrenches iżda ma jinkludux tap wrenches); sockets ta’ spanners interkambjabbli, bil-mankijiet jew le',
    'Hand tools (including glaziers\' diamonds), not elsewhere specified or included; blowlamps; vices, clamps and the like, other than accessories for and parts of machine-tools or water-jet cutting machines; anvils; portable forges; hand- or pedal-operated grinding wheels with frameworks' => 'Għodod tal-idejn (inkluż djamanti tal-vitrara), li mhumiex inklużi jew speċifikati banda oħra; blowlamps; morsi, klamps u bħalhom, għajr aċċessorji għal għodod mekkanizzati jew magni tal-qtugħ bil-ġettijiet tal-ilma u parts tagħhom; inkwini; foroġ li jinġarru; moli tal-idejn jew li jitħaddmu bil-pedali bl-oqfsa tagħhom',
    'Interchangeable tools for hand tools, whether or not power-operated, or for machine tools (for example, for pressing, stamping, punching, tapping, threading, drilling, boring, broaching, milling, turning or screw driving), including dies for drawing or extruding metal, and rock-drilling or earth-boring tools' => 'Għodod interkambjabbli għall-għodda tal-idejn, motorizzati jew le, jew għal makkinarju għodda (eż. tal-ippressar, tal-istampar, li jagħmlu t-toqob, tal-ittapsjar, tal-qtugħ ta’ kamini fuq barra, għat-titqib, għat-tħaffir, għall-broaching, għall-milling, l-inturnjar jew l-invitar), inklużi dadi għal ġbid jew l-estrużjoni ta’ metalli, u għodod għat-titqib tal-blat jew għat-tħaffir tal-art',
    'Knives and cutting blades, for machines or for mechanical appliances' => 'Skieken u xfafar li jaqtgħu, għal magni jew għal apparat mekkaniku',
    'Plates, sticks, tips and the like for tools, unmounted, of cermets' => 'Pjanċi, stikek, ponot u bħalhom għal għodod, mhux immuntati, ta’ ċermiti',
    'Knives with cutting blades, serrated or not (including pruning knives), other than knives of heading 8208, and blades therefor' => 'Skieken bi xfafar li jaqtgħu, bis-snien jew le (inkluż skieken taż-żbir), għajr skieken tal-intestatura 8208, u xfafar għalihom',
    'Razors and razor blades (including razor blade blanks in strips)' => 'Għodod għat-tqaxxir tal-leħja u xfafar tal-leħja (inkluż blanks tax-xfafar tal-leħja fi strixxi)',
    'Other articles of cutlery (for example, hair clippers, butchers\' or kitchen cleavers, choppers and mincing knives, paperknives); manicure or pedicure sets and instruments (including nail files)' => 'Oġġetti oħra tal-cutlery (eż. clippers tax-xagħar, skieken b’xafra wiesgħa tal-biċċiera jew tal-kċina, imnanar u skieken tal-ikkapuljat, taljakarti); settijiet u strumenti tal-manicure jew tal-pedicure (inkluż limi tad-dwiefer)',
    'Spoons, forks, ladles, skimmers, cake-servers, fish-knives, butter-knives, sugar tongs and similar kitchen or tableware' => 'Imgħaref, frieket, kuċċaruni, xkumaturi, cakeservers, skieken tal-ħut, skieken tal-butir, tongs taz-zokkor u oġġetti simili tal-kċina jew tal-mejda',
    'Padlocks and locks (key, combination or electrically operated), of base metal; clasps and frames with clasps, incorporating locks, of base metal; keys for any of the foregoing articles, of base metal' => 'Katnazzi u serraturi (imħaddmin biċ-ċwievet, b’kombinamenti jew bl-elettriku) ta’ metall komuni; fermaturi u gwarniċi bil-fermaturi, b’sokra inkorporata, ta’ metall komuni; ċwievet għal kwalunkwe wieħed mill-oġġetti msemmijin fuq, ta’ metall komuni',
    'Base-metal mountings, fittings and similar articles suitable for furniture, doors, staircases, windows, blinds, coachwork, saddlery, trunks, chests, caskets or the like; base-metal hat-racks, hat-pegs, brackets and similar fixtures; castors with mountings of base metal; automatic door closers of base metal' => 'Montaturi, fittings u oġġetti simili ta’ metall komuni tajbin għal għamara, bibien, turġien, twieqi, blinds, karrozzerija, oġġetti tas-sarraġ, bagolli, sniedaq, kaxxetti jew bħalhom; dniedel tal-kpiepel, witet tal-kpiepel, brackets u fixtures simili tal-metall komuni; castors b’montaturi tal-metall komuni; apparat tal-metall komuni għall-għeluq awtomatiku tal-bibien',
    'Armoured or reinforced safes, strongboxes and doors and safe deposit lockers for strong-rooms, cash or deed boxes and the like, of base metal' => 'Kaxxaforti, kaxxi u bibien rinfurzati u kompartimenti għal depożiti fiż-żgur għal kmamar rinfurzati, kaxxi għall-flus jew għal dokumenti u bħalhom korazzati jew rinforzati, ta’ metall komuni',
    'Fittings for loose-leaf binders or files, letter clips, letter corners, paper clips, indexing tags and similar office articles, of base metal; staples in strips (for example, for offices, upholstery, packaging), of base metal' => 'Fittings għal qxur jew fajls għal folji sfużi, klipep għall-ittri, kantunieri għall-ittri, paper clips, tikketti ta’ indiċjar u oġġetti tal-uffiċċju simili, ta’ metall komuni; staples fi strixxi (eż. għal uffiċċji, tapizzerija, ippakkjar), ta’ metall komuni',
    'Bells, gongs and the like, non-electric, of base metal; statuettes and other ornaments, of base metal; photograph, picture or similar frames, of base metal; mirrors of base metal' => 'Qniepen, gongi u bħalhom, mhux tal-elettriku, ta’ metall komuni; statwetti u ornamenti oħrajn, ta’ metall komuni; gwarniċi għar-ritratti, għall-istampi jew gwarniċi simili, ta’ metall komuni; mirja ta’ metall komuni',
    'Flexible tubing of base metal, with or without fittings' => 'Tubi flessibbli ta’ metall komuni, bil-fittings magħhom jew le',
