    'Stoppers, caps and lids (including crown corks, screw caps and pouring stoppers), capsules for bottles, threaded bungs, bung covers, seals and other packing accessories, of base metal' => 'Tappijiet (inkluż tappini, tappijiet bil-kamin u tappijiet tat-tferrigħ), għotjien, kapsuli għall-fliexken, tappijiet bil-kamin għall-btieti/ġarer, kuperċi tat-tappijiet, siġilli u aċċessorji oħrajn għall-ippakkjar magħmula minn metalli komuni',
    'Wire, rods, tubes, plates, electrodes and similar products, of base metal or of metal carbides, coated or cored with flux material, of a kind used for soldering, brazing, welding or deposition of metal or of metal carbides; wire and rods, of agglomerated base metal powder, used for metal spraying' => 'Wajer, vireg, tubi, pjanċi, elettrodi u prodotti simili, ta’ metall komuni jew ta’ karburi ta’ metall, miksijin jew bil-qalba b’materjal flussanti, tat-tip użat għall-issaldjar, ibbrejżjar, iwweldjar jew depożizzjoni ta’ metall jew ta’ karburi ta’ metall; wajer u vireg, ta’ trab agglomerat ta’ metall ta’ valur baxx, użat għall-isprejjar tal-metall',
    'Nuclear reactors; fuel elements (cartridges), non-irradiated, for nuclear reactors; machinery and apparatus for isotopic separation' => 'Reatturi nukleari; elementi kombustibbli (skrataċ), mhux irradjati, għal reatturi nukleari; makkinarju u apparat għas-separazzjoni isotopika',
    'Steam or other vapour generating boilers (other than central heating hot water boilers capable also of producing low pressure steam); superheated water boilers' => 'Bojlers li jiġġeneraw stim jew fwar ieħor (għajr bojlers tal-misħun tat- tisħin ċentrali li jistgħu jipproduċu ukoll stim ta’ pressjoni baxxa); bojlers tal-ilma superimsaħħan',
    'Central heating boilers other than those of heading 8402' => 'Bojlers għat-tisħin ċentrali għajr dawk tal-intestatura 8402',
    'Auxiliary plant for use with boilers of heading 8402 or 8403 (for example, economisers, superheaters, soot removers, gas recoverers); condensers for steam or other vapour power units' => 'Apparat awżiljari għall-użu ma’ bojlers tal-intestatura 8402 jew 8403 (eż. ekonomizzaturi, superheaters, apparat għat-tneħħija tan-nugrufun, irkupraturi tal-gass); kondensaturi għal unitajiet tal-enerġija bl-istim jew bi fwar ieħor',
    'Producer gas or water gas generators, with or without their purifiers; acetylene gas generators and similar water process gas generators, with or without their purifiers' => 'Ġeneraturi ta’ gass produttur (producergas) jew gass tal-ilma, bil-purifikaturi tagħhom jew le; ġeneraturi tal-gass tal-aċitilena u ġeneraturi simili ta’ gassijiet bi proċess tal-ilma, bil-purifikaturi tagħhom jew le',
    'Steam turbines and other vapour turbines' => 'Turbini tal-istim u turbini oħra tal-fwar',
    'Spark-ignition reciprocating or rotary internal combustion piston engines' => 'Magni tal-kombustjoni interna bil-pistuni reċiprokanti jew rotatorji mqabbdin bi spark',
    'Compression-ignition internal combustion piston engines (diesel or semi-diesel engines)' => 'Magni tal-kombustjoni interna bil-pistuni mqabbda bil-kompressjoni (magni diżil jew semi-diżil)',
    'Parts suitable for use solely or principally with the engines of heading 8407 or 8408' => 'Parts tajbin biss jew prinċipalment biex jintużaw mal-magni tal-intestatura 8407 jew 8408',
    'Hydraulic turbines, water wheels, and regulators therefor' => 'Turbini idrawliċi, roti tal-ilma, u r-regolaturi għalihom',
    'Turbojets, turbopropellers and other gas turbines' => 'Turbojets, turbopropellers u turbini oħrajn tal-gass',
    'Other engines and motors' => 'Magni u muturi oħrajn',
    'Pumps for liquids, whether or not fitted with a measuring device; liquid elevators' => 'Pompi għal likwidi, mgħammrin b’apparat għall-kejl jew le; elevaturi tal-likwidi',
    'Air or vacuum pumps, air or other gas compressors and fans; ventilating or recycling hoods incorporating a fan, whether or not fitted with filters; gas-tight biological safety cabinets, whether or not fitted with filters' => 'Pompi tal-arja jew tal-vakwu, kompressuri u fannijiet ta’ arja jew gass ieħor; hoods għall-ventilazzjoni jew għar-riċiklaġġ tal-arja li fihom fann, mgħammar bil-filtri; kabinetti tas-sikurezza bijoloġiċi li ma joħroġx gass minnhom, kemm jekk mgħammrin b’filters u kemm jekk le',
    'Air-conditioning machines, comprising a motor-driven fan and elements for changing the temperature and humidity, including those machines in which the humidity cannot be separately regulated' => 'Magni tal-arja kundizzjonata, li fihom fann bil-mutur u elementi għall-bdil tat-temperatura u tal-umdità, inkluż dawk il-magni li fihom l-umdità ma tistax tkun irregolata separatament',
    'Furnace burners for liquid fuel, for pulverised solid fuel or for gas; mechanical stokers, including their mechanical grates, mechanical ash dischargers and similar appliances' => 'Burners tal-fran għal karburant likwidu, għal karburant solidu mfarrak jew għal gass; apparat mekkaniku li jnajjar il-bajli, inkluż il-gradilji tagħhom, skargaturi mekkaniċi tal-irmied u apparat simili',
    'Industrial or laboratory furnaces and ovens, including incinerators, non-electric' => 'Fran industrijali jew tal-laboratorju, inkluż inċineraturi, mhux tal-elettriku',
    'Refrigerators, freezers and other refrigerating or freezing equipment, electric or other; heat pumps other than air-conditioning machines of heading 8415' => 'Friġġijiet, friżi u tagħmir ieħor għat-tkessiħ jew iffriżar, tal-elettriku jew oħrajn; pompi tas-sħana għajr magni tal-arja kundizzjonata tal-intestatura 8415',
    'Machinery, plant or laboratory equipment, whether or not electrically heated (excluding furnaces, ovens and other equipment of heading 8514), for the treatment of materials by a process involving a change of temperature such as heating, cooking, roasting, distilling, rectifying, sterilising, pasteurising, steaming, drying, evaporating, vaporising, condensing or cooling, other than machinery or plant of a kind used for domestic purposes; instantaneous or storage water heaters, non-electric' => 'Makkinarju, apparat jew tagħmir tal-laboratorju, imsaħħan bl-elettriku jew le (ħlief fran u tagħmir ieħor tal-intestatura 8514), għat-trattament ta’ materjali bi proċess li jinvolvi bidla ta’ temperatura bħal tisħin, tisjir, xiwi, iddistillar, rettifikar, sterilizzar, pastorizzar, tisjir bl-istim, tnixxif, evaporar, vaporizzar, ikkondensar jew tkessiħ, għajr makkinarju jew impjant tat-tip użat għal finijiet domestiċi; heaters tal-ilma istantanji jew tal-ilma maħżun, mhux tal-elettriku',
    'Calendering or other rolling machines, other than for metals or glass, and cylinders therefor' => 'Magni tal-mogħdija jew magni oħrajn bir-rombli, għajr għal metalli jew ħġieġ, u ċilindri għalihom',
    'Centrifuges, including centrifugal dryers; filtering or purifying machinery and apparatus, for liquids or gases' => 'Magni ċentrifugali, inkluż magni tat-tnixxif ċentrifugali; makkinarju u apparat li jiffiltraw jew isaffu, likwidi jew gassijiet',
    'Dishwashing machines; machinery for cleaning or drying bottles or other containers; machinery for filling, closing, sealing or labelling bottles, cans, boxes, bags or other containers; machinery for capsuling bottles, jars, tubes and similar containers; other packing or wrapping machinery (including heat-shrink wrapping machinery); machinery for aerating beverages' => 'Magni għall-ħasil tal-platti; makkinarju għat-tindif jew għat-tnixxif ta’ fliexken jew kontenituri oħrajn; makkinarju għall-mili, għeluq, issiġillar jew twaħħil ta’ tikketti ma’ fliexken, laned, kaxex, boroż jew kontenituri oħrajn; makkinarju għat-tqegħid tal-għotien ta’ fliexken, vażetti, tubi u kontenituri simili; makkinarju ieħor għal ippakkjar jew tgeżwir (inkluż makkinarju għall-heat shrink wrapping); makkinarju għall-aerazzjoni tax-xorb',
    'Weighing machinery (excluding balances of a sensitivity of 5 cg or better), including weight-operated counting or checking machines; weighing machine weights of all kinds' => 'Makkinarju għal użin (ħlief imwieżen b’sensittività ta’ 5 cg jew aħjar), inkluż magni li jgħoddu jew li jiċċekkjaw regolati bl-użin; piżijiet ta’ kull tip għall-magni ta’ użin',
    'Mechanical appliances (whether or not hand-operated) for projecting, dispersing or spraying liquids or powders; fire extinguishers, whether or not charged; spray guns and similar appliances; steam or sandblasting machines and similar jet projecting machines' => 'Apparat mekkaniku (tal-idejn jew le) għax-xħit, it-tixrid jew it-traxxix ta’ likwidi jew trabijiet; apparat għat-tifi tan-nar, ikkargat jew le; apparat għat-traxxix u tagħmir simili; magni tal-istim jew tas-sandblasting u magni simili bil-ġettijiet',
    'Pulley tackle and hoists other than skip hoists; winches and capstans; jacks' => 'Paranki għajr skip-hoists; winċijiet u capstans; ġakkijiet',
    'Ships\' derricks; cranes, including cable cranes; mobile lifting frames, straddle carriers and works trucks fitted with a crane' => 'Deriks ta’ vapuri; krejnijiet, inkluż krejnijiet bil-kejbil; oqfsa tal-irfigħ mobbli, straddlecarriers u trakkijiet tax-xogħol mgħammrin bi krejn',
    'Fork-lift trucks; other works trucks fitted with lifting or handling equipment' => 'Trakkijiet fork-lift; trakkijiet oħrajn tax-xogħol mgħammrin b’tagħmir għall-irfigħ jew għall-ispustjar',
    'Other lifting, handling, loading or unloading machinery (for example, lifts, escalators, conveyors, teleferics)' => 'Makkinarju ieħor għall-irfigħ, għall-ispustjar, għat-tagħbija u għall-ħatt (eż. liftijiet, escalators, conveyors, teleferiki)',
    'Self-propelled bulldozers, angledozers, graders, levellers, scrapers, mechanical shovels, excavators, shovel loaders, tamping machines and roadrollers' => 'Bulldozers, angledozers, graders, magni tal-invellar, barraxi, mechanical shovels, skavaturi, shovel loaders, magni għat-tbattim u rombli tat-triq awtopropulsivi',
    'Other moving, grading, levelling, scraping, excavating, tamping, compacting, extracting or boring machinery, for earth, minerals or ores; piledrivers and pile extractors; snowploughs and snowblowers' => 'Makkinarju ieħor għaċ-ċaqliq, l-iggradar, l-invellar, il-brix, it-tħaffir, l-ibbatmar, l-ikkompattar, l-estrazzjoni jew it-tħaffir, ta’ materjali tal-art, minerali jew minerali mhux maħduma; magni għall-ingastar jew il-qlugħ tal-puntali; imħaret tas-silġ u magni li jtajru s-silġ',
    'Parts suitable for use solely or principally with the machinery of headings 8425 to 8430' => 'Parts tajbin biss jew prinċipalment għal użu mal-makkinarju tal-intestaturi 8425 sa 8430',
    'Agricultural, horticultural or forestry machinery for soil preparation or cultivation; lawn or sports-ground rollers' => 'Makkinarju agrikolu, ortikulturali jew tal-forestrija għall-preparazzjoni jew il-kultivazzjoni tal-ħamrija; rombli għal lawn jew għal grounds tal-isports',
    'Harvesting or threshing machinery, including straw or fodder balers; grass or hay mowers; machines for cleaning, sorting or grading eggs, fruit or other agricultural produce, other than machinery of heading 8437' => 'Makkinarju tal-ħsad u tad-dris, inkluż magni li jinballaw it-tiben u l-foraġġ; mowers tal-ħaxix jew ħuxlief; magni li jaħslu, jagħżlu u jiggradaw bajd, frott jew prodotti agrikoli oħrajn, għajr makkinarju tal-intestatura 8437',
    'Milking machines and dairy machinery' => 'Magni li jaħilbu u makkinarju tal-maħleb',
    'Presses, crushers and similar machinery used in the manufacture of wine, cider, fruit juices or similar beverages' => 'Preses, magni li jfarrku u makkinarju simili użat fil-manifattura tal-inbid, tas-sidru, tal-meraq tal-frott jew xarbiet simili',
