    'Machines for cleaning, sorting or grading seed, grain or dried leguminous vegetables; machinery used in the milling industry or for the working of cereals or dried leguminous vegetables, other than farm-type machinery' => 'Magni li jnaddfu, jagħżlu u jiggradaw iż-żrieragħ, ħbub jew ħxejjex leguminużi nixfin; makkinarju użat fl-industrija tat-tħin jew biex jinħadmu ċereali jew ħxejjex leguminużi nixfin, għajr makkinarju tat-tip tal-farm',
    'Machinery, not specified or included elsewhere in this chapter, for the industrial preparation or manufacture of food or drink, other than machinery for the extraction or preparation of animal or fixed vegetable or microbial fats or oils' => 'Makkinarju, mhux speċifikat jew inkluż banda oħra f’dan il-Kapitolu, għall-preparazzjoni jew manifattura industrijali ta’ ikel jew xorb, għajr makkinarju għall-estrazzjoni jew preparazzjoni ta’ xaħmijiet jew żjut ta’ annimali, veġetali jew mikrobiċi fissi',
    'Machinery for making pulp of fibrous cellulosic material or for making or finishing paper or paperboard' => 'Makkinarju għall-produzzjoni tal-polpa minn materjal ċellulożiku fibruż jew makkinarju għall-produzzjoni jew għall-finitura tal-karta jew tal-kartun',
    'Bookbinding machinery, including book-sewing machines' => 'Makkinarju għal illegar tal-kotba, inkluż magni tal-ħjata tal-kotba',
    'Other machinery for making up paper pulp, paper or paperboard, including cutting machines of all kinds' => 'Makkinarju ieħor għall-produzzjoni tal-polpa tal-karta, karta jew kartun, inkluż magni tal-qtugħ ta’ kull għamla',
    'Machinery, apparatus and equipment (other than the machines of headings 8456 to 8465) for preparing or making plates, cylinders or other printing components; plates, cylinders and other printing components; plates, cylinders and lithographic stones, prepared for printing purposes (for example, planed, grained or polished)' => 'Makkinarju, apparat u tagħmir (għajr il-magni tal-intestaturi 8456 sa 8465) għat-tħejjija jew il-manifattura ta’ pjanċi, ċilindri jew komponenti oħra ta’ stampar; pjanċi, ċilindri u komponenti oħra ta’ stampar; pjanċi, ċilindri u ġebel litografiku, imħejjija għal finijiet ta’ stampar (eż. inċanati, ivvinati jew illustrati)',
    'Printing machinery used for printing by means of plates, cylinders and other printing components of heading 8442; other printers, copying machines and facsimile machines, whether or not combined; parts and accessories thereof' => 'Makkinarju għall-istampar użat biex jistampa permezz ta’ pjanċi, ċilindri u komponenti oħra ta’ stampar tal-intestatura 8442; printers, fotokopjaturi u magni tal-faksimile oħra, kemm jekk ikkombinati u kemm jekk mhumiex; parts u aċċessorji tagħhom',
    'Machines for extruding, drawing, texturing or cutting man-made textile materials' => 'Magni għall-estrużjoni, il-ġbid, it-tessurizzazzjoni jew il-qtugħ ta’ materjali tessili magħmulin mill-bniedem',
    'Machines for preparing textile fibres; spinning, doubling or twisting machines and other machinery for producing textile yarns; textile reeling or winding (including weft-winding) machines and machines for preparing textile yarns for use on the machines of heading 8446 or 8447' => 'Magni biex jippreparaw fibri ta’ tessuti; magni tal-għażil, magni li jirduppjaw jew magni li jobormu u makkinarju ieħor għall-produzzjoni ta’ raden tessili; magni għall-irrumblar jew tkebbib (inkluż tkebbib fuq it-tagħma) u magni biex jippreparaw raden tessili għal użu fuq il-magni tal-intestatura 8446 jew 8447',
    'Weaving machines (looms)' => 'Magni tal-insiġ (nwiel)',
    'Knitting machines, stitch-bonding machines and machines for making gimped yarn, tulle, lace, embroidery, trimmings, braid or net and machines for tufting' => 'Magni tal-innittjar, magni għat-tiġnit bit-tpannit u magni biex jaħdmu r-raden iggimmjat, tull, bizzilla, rakkmu, tberfil, malji jew xibka u magni tat-trapuntar',
    'Auxiliary machinery for use with machines of heading 8444, 8445, 8446 or 8447 (for example, dobbies, jacquards, automatic stop motions, shuttle changing mechanisms); parts and accessories suitable for use solely or principally with the machines of this heading or of heading 8444, 8445, 8446 or 8447 (for example, spindles and spindle flyers, card clothing, combs, extruding nipples, shuttles, healds and heald-frames, hosiery needles)' => 'Makkinarju awżiljari għall-użu ma’ magni tal-intestaturi 8444, 8445, 8446 jew 8447 (eż. dobbies, jacquards, apparat awtomatiku għat-twaqqif tal-moviment, mekkaniżmi biex jibdlu l-mekkuk); parts u aċċessorji tajbin biss jew prinċipalment għall-użu mal-magni ta’ din l-intestatura jew tal-intestaturi 8444, 8445, 8446 jew 8447 (eż. mgħażel u flyers tal-imgħażel, card clothing, imxat, bżieżel tal-estrużjoni, imkiekek, nir tan-newl u oqfsa tan-nir, labar tal-kalzetti)',
    'Household or laundry-type washing machines, including machines which both wash and dry' => 'Magni tal-ħasil tal-ħwejjeġ għad-dar jew tat-tip li jintużaw fil-laundries, inkluż magni li jaħslu kif ukoll inixxfu',
    'Machinery (other than machines of heading 8450) for washing, cleaning, wringing, drying, ironing, pressing (including fusing presses), bleaching, dyeing, dressing, finishing, coating or impregnating textile yarns, fabrics or made-up textile articles and machines for applying the paste to the base fabric or other support used in the manufacture of floor coverings such as linoleum; machines for reeling, unreeling, folding, cutting or pinking textile fabrics' => 'Makkinarju (għajr magni tal-intestatura 8450) għal ħasil, tindif, għasir, tnixxif, mogħdija, ippressar (inkluż preses li jġonġu), ibbliċjar, żbigħ, tiżjin, finitura, kisi jew imprenjar ta’ raden tessili, drappijiet jew oġġetti tessili magħmulin u magni biex tiġi applikata l-paste lid-drapp ta’ bażi jew lil irfid ieħor użati fil-manifattura ta’ kisi tal-art bħal-linoleum; magni għat-tkebbib, il-ħall, it-tini, il-qtugħ jew il-qtugħ bil-pizzi ta’ drappijiet ta’ tessuti',
    'Sewing machines, other than book-sewing machines of heading 8440; furniture, bases and covers specially designed for sewing machines; sewing machine needles' => 'Magni tal-ħjata, għajr magni tal-ħjata għall-kotba tal-intestatura 8440; għamara, bażijiet u għata magħmulin apposta għall-magni tal-ħjata; labar tal-magni tal-ħjata',
    'Machinery for preparing, tanning or working hides, skins or leather or for making or repairing footwear or other articles of hides, skins or leather, other than sewing machines' => 'Makkinarju għall-preparazzjoni, l-ikkonzar jew xogħol ta’ ġlud jew għall-produzzjoni jew għat-tiswija ta’ xedd is-saqajn jew oġġetti oħrajn tal-ġlud, għajr magni tal-ħjata',
    'Converters, ladles, ingot moulds and casting machines, of a kind used in metallurgy or in metal foundries' => 'Konvertituri, kuċċari, forom ta’ ingotti u magni tal-iffondar, tat-tip użati fil-metallurġija jew f’funderiji tal-metall',
    'Metal-rolling mills and rolls therefor' => 'Laminaturi tal-metall u r-rombli tagħhom',
    'Machine tools for working any material by removal of material, by laser or other light or photon beam, ultrasonic, electrodischarge, electrochemical, electron beam, ionic-beam or plasma arc processes; water-jet cutting machines' => 'Makkinarju għodda għax-xogħol fuq kwalunkwe materjal bit-tneħħija ta’ materjal, bil-laser jew raġġ ieħor ta’ dawl jew proċess ta’ raġġ fotoniku, raġġ ultrasoniku, bi skariku elettriku, elettrokimiku, ta’ raġġ ta’ elettroni, raġġ joniku jew proċessi ta’ ark ta’ plażma; magni tal-qtugħ bil-ġettijiet tal-ilma',
    'Machining centres, unit construction machines (single station) and multi-station transfer machines, for working metal' => 'Ċentri tal-immaxinjar, magni għall-kostruzzjoni f’unità waħda (stazzjon wieħed) u magni ta’ trasferiment b’ħafna stazzjonijiet, għal xogħol tal-metall',
    'Lathes (including turning centres) for removing metal' => 'Tornijiet (inkluż ċentri tal-inturnjar) għat-tneħħija ta’ metall',
    'Machine tools (including way-type unit head machines) for drilling, boring, milling, threading or tapping by removing metal, other than lathes (including turning centres) of heading 8458' => 'Makkinarju għodda (inkluż magni way-type b’ras waħda) għal titqib, tħaffir, milling, qtugħ ta’ kamini esterni jew ittapsjar bit-tneħħija tal-metall, għajr tornijiet (inkluż ċentri ta’ inturnjar) tal-intestatura 8458',
    'Machine tools for deburring, sharpening, grinding, honing, lapping, polishing or otherwise finishing metal or cermets by means of grinding stones, abrasives or polishing products, other than gear cutting, gear grinding or gear finishing machines of heading 8461' => 'Makkinarju għodda biex ineħħi x-xfar, isinn, jimmola, iraqqam, jillappja, jillostra jew għall-finitura mod ieħor ta’ metall jew ċermiti permezz ta’ ħaġar tal-mola, sustanzi abrażivi jew prodotti tal-lostru, għajr magni għall-qtugħ, l-immolar jew il-finitura tal-gerijiet tal-intestatura 8461',
    'Machine tools for planing, shaping, slotting, broaching, gear cutting, gear grinding or gear finishing, sawing, cutting-off and other machine tools working by removing metal or cermets, not elsewhere specified or included' => 'Makkinarju għodda għall-inċanar, iffurmar, qtugħ ta’ kanali, broaching, għall-qtugħ, immolar jew finitura tal-gerijiet, isserrar, qtugħ barra u għodod ta’ magni oħrajn li jaħdmu billi jneħħu metall jew ċermiti, li mhumiex speċifikati jew inklużi banda oħra',
    'Machine tools (including presses) for working metal by forging, hammering or die forging (excluding rolling mills); machine tools (including presses, slitting lines and cut-to-length lines) for working metal by bending, folding, straightening, flattening, shearing, punching, notching or nibbling (excluding draw-benches); presses for working metal or metal carbides, not specified above' => 'Makkinarju għodda (inkluż preses) biex jinħadem metall bil-kiwi fil-forġa, immartellar jew stampar bil-forom (eskluż il-laminaturi); makkinarju għodda (inkluż preses, linji ta’ qtugħ lonġitudinali u linji ta’ qtugħ għall-qies) għax-xogħol tal-metall permezz tat-tgħawwiġ, tat-tini, tal-iddrittar, tal-iċċattjar, tat-tagħfis, tat-titqib, tal-qtugħ tat-talji jew tat-tirqim (esklużi l-magni tal-ġbid ta’ żbarri); preses għax-xogħol tal-metall jew tal-karburi tal-metall, mhux speċifikati hawn fuq',
    'Other machine tools for working metal or cermets, without removing material' => 'Makkinarju għodda oħrajn biex jinħadem metall jew ċermiti, mingħajr ma jitneħħa materjal',
    'Machine tools for working stone, ceramics, concrete, asbestos-cement or like mineral materials or for cold working glass' => 'Makkinarju għodda biex jinħadmu l-ġebla, iċ-ċeramika, il-konkos, is-simentasbestos jew materjali minerali bħalhom jew għall-ħdim fil-kiesaħ tal-ħġieġ',
    'Machine tools (including machines for nailing, stapling, glueing or otherwise assembling) for working wood, cork, bone, hard rubber, hard plastics or similar hard materials' => 'Makkinarju għodda (inkluż magni biex isammru, iwaħħlu l-istaples, jinkullaw jew jimmuntaw mod ieħor) għax-xogħol tal-injam, tas-sufra, tal-għadam, tal-lastiku iebes, tal-plastiks ibsin jew ta’ materjali simili ibsin',
    'Parts and accessories suitable for use solely or principally with the machines of headings 8456 to 8465, including work or tool holders, self-opening dieheads, dividing heads and other special attachments for the machines; tool holders for any type of tool for working in the hand' => 'Parts u aċċessorji tajbin biss jew prinċipalment għal użu mal-magni tal-intestaturi 8456 sa 8465, inkluż holders tax-xogħol jew tal-għodda, dieheads jinfetħu waħedhom, dividing heads u apparat anċillari ieħor speċjali għall-magni; holders tal-għodda għal kwalunkwe tip ta’ għodda biex taħdem fl-idejn',
    'Tools for working in the hand, pneumatic, hydraulic or with self-contained electric or non-electric motor' => 'Għodod biex jaħdmu fl-idejn, pnewmatiċi, idrawliċi jew b’mutur elettriku jew mhux elettriku fihom stess',
    'Machinery and apparatus for soldering, brazing or welding, whether or not capable of cutting, other than those of heading 8515; gas-operated surface tempering machines and appliances' => 'Makkinarju u apparat għall-issaldjar, ibbrejżjar jew iwweldjar, kemm jekk jista’ jaqta’ kif ukoll jekk le, għajr dawk tal-intestatura 8515; magni u apparati li jaħdmu bil-gass biex jittempraw is-superfiċji',
    'Calculating machines and pocket-size data-recording, reproducing and displaying machines with calculating functions; accounting machines, postage-franking machines, ticket-issuing machines and similar machines, incorporating a calculating device; cash registers' => 'Kalkulatriċi u magni li joqogħdu fil-but b’funzjonijiet li jikkalkulaw biex jirrekordjaw, jirriproduċu u juru data; magni tal-kontabbiltà, magni tal-iffrankar tal-ittri, magni li jagħtu l-biljetti u magni simili, li fihom apparat li jikkalkula; cash registers',
    'Automatic data-processing machines and units thereof; magnetic or optical readers, machines for transcribing data onto data media in coded form and machines for processing such data, not elsewhere specified or included' => 'Magni għall-ipproċessar awtomatiku tad-data u unitajiet tagħhom; apparat li jaqra b’sistema manjetika jew ottika, magni biex jittraskrivu data fuq data media f’għamla kkowdjata u magni biex jipproċessaw din id-data, li mhumiex speċifikati jew inklużi banda oħra',
    'Other office machines (for example, hectograph or stencil duplicating machines, addressing machines, automatic banknote dispensers, coin-sorting machines, coin-counting or -wrapping machines, pencil-sharpening machines, perforating or stapling machines)' => 'Magni oħrajn tal-uffiċċju (eż. duplikaturi bl-ettograf jew stencil, magni tal-indirizzi, distributuri awtomatiċi tal-karti tal-flus, magni li jagħżlu l-muniti, magni li jgħoddu jew igeżwru l-muniti, magni li jittempraw lapsijiet, magni li jtaqqbu jew li jwaħħlu l-istaples)',
    'Parts and accessories (other than covers, carrying cases and the like) suitable for use solely or principally with machines of headings 8470 to 8472' => 'Parts u aċċessorji (għajr għata, bagalji tat-trasport u oġġetti bħal dawn) tajbin biss u prinċipalment għall-użu ma’ magni tal-intestaturi 8470 sa 8472',
    'Machinery for sorting, screening, separating, washing, crushing, grinding, mixing or kneading earth, stone, ores or other mineral substances, in solid (including powder or paste) form; machinery for agglomerating, shaping or moulding solid mineral fuels, ceramic paste, unhardened cements, plastering materials or other mineral products in powder or paste form; machines for forming foundry moulds of sand' => 'Makkinarju li jagħżel, jgħarbel, jissepara, jaħsel, ifarrak, jimmola, iħallat jew jagħġen materjali tal-art, ġebel, minerali mhux maħduma jew sustanzi minerali oħrajn, f’forma solida (inkluż trab jew paste); makkinarju agglomeranti, jagħti sura jew jifforma karburanti minerali solidi, paste taċ-ċeramika, simenti mhux imwebbsin, materjali tat-tikħil jew prodotti minerali oħrajn f’forma ta’ trab jew paste; magni għall-iffurmar tal-forom tar-ramel għall-funderiji',
    'Machines for assembling electric or electronic lamps, tubes or valves or flashbulbs, in glass envelopes; machines for manufacturing or hot working glass or glassware' => 'Makkinarju għall-immuntar ta’ lampi elettriċi jew elettroniċi, tubi jew valvi jew bozoz tal-flaxx, f’involukri tal-ħġieġ; magni għal manifattura jew għall-ħdim fis-sħana tal-ħġieġ jew oġġetti tal-ħġieġ',
    'Automatic goods-vending machines (for example, postage stamp, cigarette, food or beverage machines), including money-changing machines' => 'Magni awtomatiċi għal bejgħ ta’ oġġetti (eż. magni tal-bolol postali, sigaretti, ikel jew xorb), inkluż magni li jsarrfu l-flus',
    'Machinery for working rubber or plastics or for the manufacture of products from these materials, not specified or included elsewhere in this chapter' => 'Makkinarju għal xogħol tal-lastiku jew plastiks jew għall-manifattura ta’ prodotti minn dawn il-materjali, mhux speċifikat jew inkluż banda oħra f’dan il-kapitolu',
    'Machinery for preparing or making up tobacco, not specified or included elsewhere in this chapter' => 'Makkinarju li jipprepara jew jaħdem it-tabakk, mhux speċifikat jew inkluż banda oħra f’dan il-kapitolu',
    'Machines and mechanical appliances having individual functions, not specified or included elsewhere in this chapter' => 'Magni u apparat mekkaniku b’funzjonijiet individwali, mhux speċifikati jew inklużi banda oħra f’dan il-kapitolu',
    'Moulding boxes for metal foundry; mould bases; moulding patterns; moulds for metal (other than ingot moulds), metal carbides, glass, mineral materials, rubber or plastics' => 'Kaxex forom għall-funderija tal-metall; bażijiet ta’ forom; disinji għax-xogħol bil-mol; forom għall-metall (għajr forom ta’ ingotti), karburi tal-metall, ħġieġ, materjali minerali, lastiku jew plastiks',
    'Taps, cocks, valves and similar appliances for pipes, boiler shells, tanks, vats or the like, including pressure-reducing valves and thermostatically controlled valves' => 'Viti, cocks, valvi u apparat simili għal pajpijiet, qxur tal-bojlers, tankijiet, btieti jew bħalhom, inkluż valvi biex inaqqsu l-pressa u valvi kkontrollati b’mod termostatiku',
    'Ball or roller bearings' => 'Ball bearings jew bearings bir-rombli',
    'Transmission shafts (including cam shafts and crank shafts) and cranks; bearing housings and plain shaft bearings; gears and gearing; ball or roller screws; gear boxes and other speed changers, including torque converters; flywheels and pulleys, including pulley blocks; clutches and shaft couplings (including universal joints)' => 'Xaftijiet tat-trażmissjoni (inkluż kamxafts u krankxafts) u krankijiet; housings tal-bearings u shaft bearings lixxi; gerijiet u settijiet ta’ gerijiet; ball screws jew roller screws; gearboxes u oġġetti oħrajn li jibdlu l-veloċità, inkluż torqueconvertors; flywheels u tarjoli, inklużi blokki ta’ tarjoli; klaċċijiet u shaft couplings (inkluż ġonot universali)',
    'Gaskets and similar joints of metal sheeting combined with other material or of two or more layers of metal; sets or assortments of gaskets and similar joints, dissimilar in composition, put up in pouches, envelopes or similar packings; mechanical seals' => 'Gaskets u ġonot simili ta’ folji tal-metall ikkombinati ma’ materjal ieħor jew ta’ żewġ saffi jew iktar ta’ metall; settijiet jew assortimenti ta’ gaskets u ġonot simili, mhux l-istess fil-kompożizzjoni, ippreżentati f’boroż, envelops jew pakki simili; siġilli mekkaniċi',
    'Machines for additive manufacturing' => 'Magni għall-manifattura addittiva',
    'Machines and apparatus of a kind used solely or principally for the manufacture of semiconductor boules or wafers, semiconductor devices, electronic integrated circuits or flat panel displays; machines and apparatus specified in note 11(C) to this chapter; parts and accessories' => 'Magni u apparat tat-tip użat biss jew prinċipalment għall-manifattura ta’ boules jew wafers semikondutturi, apparati semikondutturi, ċirkwiti integrati elettroniċi jew displays b’pannelli ċatti; magni u apparat speċifikati fin-nota 11(C) ta’ dan il-kapitolu; parts u aċċessorji',
    'Machinery parts, not containing electrical connectors, insulators, coils, contacts or other electrical features, not specified or included elsewhere in this chapter' => 'Parts ta’ makkinarju, mingħajr konnetturi elettriċi, iżolaturi, koljaturi, kuntatti jew karatteristiċi elettriċi oħrajn, mhux speċifikati jew inklużi banda oħra f’dan il-kapitolu',
    'Electric motors and generators (excluding generating sets)' => 'Muturi elettriċi u ġeneraturi (ħlief settijiet ta’ ġenerazzjoni)',
    'Electric generating sets and rotary converters' => 'Settijiet ta’ ġenerazzjoni tal-elettriku u konvertituri rotatorji',
    'Parts suitable for use solely or principally with the machines of heading 8501 or 8502' => 'Parts tajbin biss jew prinċipalment għall-użu mal-magni tal-intestatura 8501 jew 8502',
    'Electrical transformers, static converters (for example, rectifiers) and inductors' => 'Transformers tal-elettriku, konvertituri statiċi (eż. rettifikaturi) u indutturi',
    'Electromagnets; permanent magnets and articles intended to become permanent magnets after magnetisation; electromagnetic or permanent magnet chucks, clamps and similar holding devices; electromagnetic couplings, clutches and brakes; electromagnetic lifting heads' => 'Elettrokalamiti; kalamiti permanenti u oġġetti maħsubin li jsiru kalamiti permanenti wara l-manjetizzazzjoni; ċakkijiet, klamps u apparati oħrajn tal-qbid, elettromanjetiċi jew bil-kalamiti permanenti; couplings, klaċċijiet u brejkijiet elettromanjetiċi; irjus tal-irfigħ elettromanjetiċi',
    'Primary cells and primary batteries' => 'Ċelloli primarji u batteriji primarji',
    'Electric accumulators, including separators therefor, whether or not rectangular (including square)' => 'Akkumulaturi elettriċi, inkluż separaturi għalihom, rettangulari (inkluż kwadri) jew le',
    'Vacuum cleaners' => 'Vacuum cleaners',
    'Electromechanical domestic appliances, with self-contained electric motor, other than vacuum cleaners of heading 8508' => 'Apparat elettromekkaniku għad-dar, li għandu inkorporat fih mutur elettriku, għajr vacuumcleaners tal-intestatura 8508',
    'Shavers, hair clippers and hair-removing appliances, with self-contained electric motor' => 'Magni li jqaxxru l-leħja/s-suf, clippers tax-xagħar u apparati għat-tneħħija tax-xagħar, b’mutur tal-elettriku integrat',
    'Electrical ignition or starting equipment of a kind used for spark-ignition or compression-ignition internal combustion engines (for example, ignition magnetos, magneto-dynamos, ignition coils, sparking plugs and glow plugs, starter motors); generators (for example, dynamos, alternators) and cut-outs of a kind used in conjunction with such engines' => 'Tagħmir tal-ignition elettrika jew tal-istartjar tat-tip użat għall-magni tal-kombustjoni interna bil-pistuni mqabbdin bi spark jew imqabbdin bil-kompressjoni (eż. magnetos għall-ignition, magneto-dynamos, coils tal-ignition, sparking plugs u glow plugs, starter motors); ġeneraturi (eż. dinamos, alternaturi) u cut-outs tat-tip użat flimkien ma’ dawn il-magni',
    'Electrical lighting or signalling equipment (excluding articles of heading 8539), windscreen wipers, defrosters and demisters, of a kind used for cycles or motor vehicles' => 'Tagħmir tad-dawl jew tas-sinjalar tal-elettriku (ħlief oġġetti tal-intestatura 8539), windscreen wipers, defrosters u demisters, tat-tip użati għal roti jew għal vetturi bil-muturi',
    'Portable electric lamps designed to function by their own source of energy (for example, dry batteries, accumulators, magnetos), other than lighting equipment of heading 8512' => 'Lampi tal-elettriku li jinġarru maħsubin biex jaħdmu mas-sors ta’ enerġija tagħhom stess (eż. batteriji xotti, akkumulaturi, magnetos), għajr tagħmir tad-dawl tal-intestatura 8512',
    'Industrial or laboratory electric furnaces and ovens (including those functioning by induction or dielectric loss); other industrial or laboratory equipment for the heat treatment of materials by induction or dielectric loss' => 'Fran tal-elettriku industrijali jew tal-laboratorju (inkluż dawk li jaħdmu b’induzzjoni jew telf dielettriku); tagħmir ieħor industrijali jew tal-laboratorju għat-trattament bit-tisħin ta’ materjali b’induzzjoni jew telf dielettriku',
    'Electric (including electrically heated gas), laser or other light or photon beam, ultrasonic, electron beam, magnetic pulse or plasma arc soldering, brazing or welding machines and apparatus, whether or not capable of cutting; electric machines and apparatus for hot spraying of metals or cermets' => 'Magni u apparat (inkluż gass imsaħħan bl-elettriku), b’raġġ elettriku tal-laser jew tad-dawl jew foton ieħor, ta’ raġġ ultrasoniku ta’ elettroni, tal-issaldjar, tal-ibbrejżjar jew tal-iwweldjar b’polz manjetiku jew arka ta’ plażma, kemm jekk tajbin biex jaqtgħu jew le; magni u apparat tal-elettriku għall-isprejjar bit-tisħin ta’ metalli u ċermiti',
    'Electric instantaneous or storage water heaters and immersion heaters; electric space-heating apparatus and soil-heating apparatus; electrothermic hairdressing apparatus (for example, hairdryers, hair curlers, curling tong heaters) and hand dryers; electric smoothing irons; other electrothermic appliances of a kind used for domestic purposes; electric heating resistors, other than those of heading 8545' => 'Heaters tal-ilma tal-elettriku istantanji jew heaters tal-ilma maħżun u heaters tal-immersjoni; apparat tal-elettriku għat-tisħin ta’ spazji u apparat għat-tisħin tal-ħamrija; apparat elettrotermiku għall-irranġar tax-xagħar (eż. hairdryers, curlers tax-xagħar, heaters għat-tongs għall-innukklar tax-xagħar) u magni tat-tnixxif li jinħadmu bl-idejn; ħadidiet tal-mogħdija tal-elettriku; apparat elettrotermiku ieħor tat-tip użat għall-finijiet domestiċi; reżisturi elettriċi għat-tisħin, għajr dawk tal-intestatura 8545',
    'Telephone sets, including smartphones and other telephones for cellular networks or for other wireless networks; other apparatus for the transmission or reception of voice, images or other data, including apparatus for communication in a wired or wireless network (such as a local or wide area network), other than transmission or reception apparatus of heading 8443, 8525, 8527 or 8528' => 'Settijiet tat-telefown, inkluż smartphones u telefowns oħrajn għan-networks ċellulari jew għal networks oħra bla wajers; apparat ieħor għat-trażmissjoni jew riċezzjoni tal-vuċi, tal-immaġnijiet jew ta’ data oħra, inkluż apparat għall-komunikazzjoni f’network ikkollegat bil-wajer jew bla wajers (bħal network ta’ żona lokali jew ta’ żona wiesgħa), għajr apparat tat-trażmissjoni jew tar-riċezzjoni tal-intestaturi 8443, 8525, 8527 jew 8528',
    'Microphones and stands therefor; loudspeakers, whether or not mounted in their enclosures; headphones and earphones, whether or not combined with a microphone, and sets consisting of a microphone and one or more loudspeakers; audio-frequency electric amplifiers; electric sound amplifier sets' => 'Mikrofoni u stands għalihom; loudspeakers, immuntati fil-kaxex tagħhom jew le; headphones u earphones, ikkombinati ma’ mikrofonu jew le, u settijiet magħmulin minn mikrofonu u loudspeaker wieħed jew iktar; amplifikaturi elettriċi tal-awdjofrekwenzi; settijiet elettriċi għall-amplifikazzjoni tal-ħoss',
    'Sound recording or sound reproducing apparatus' => 'Apparat tal-irrekordjar jew tar-riproduzzjoni tal-ħoss',
    'Video recording or reproducing apparatus, whether or not incorporating a video tuner' => 'Apparat li jirrekordja jew jirriproduċi l-video, li fihom jew ma fihomx tuner tal-video',
    'Parts and accessories suitable for use solely or principally with the apparatus of heading 8519 or 8521' => 'Parts u aċċessorji tajbin biss jew prinċipalment għall-użu mal-apparat tal-intestatura 8519 jew 8521',
    'Discs, tapes, solid-state non-volatile storage devices, smart cards and other media for the recording of sound or of other phenomena, whether or not recorded, including matrices and masters for the production of discs, but excluding products of Chapter 37' => 'Diski, tapes, apparati tal-ħżin mhux volatili b’komponenti fi stat solidu, smartcards u media oħra għall-irrekordjar tal-ħoss jew ta’ fenomeni oħra, kemm jekk irrekordjati u kemm jekk mhumiex, inkluż matriċi u oriġinali għall-produzzjoni tad-diski, iżda esklużi l-prodotti tal-Kapitolu 37',
    'Flat panel display modules, whether or not incorporating touch-sensitive screens' => 'Moduli tad-displays pannelli ċatti, kemm jekk jinkorporaw skrins tattili u kemm jekk le',
    'Transmission apparatus for radio-broadcasting or television, whether or not incorporating reception apparatus or sound recording or reproducing apparatus; television cameras, digital cameras and video camera recorders' => 'Apparat tat-trażmissjoni għax-xandir bir-radju jew bit-televiżjoni, kemm jekk fih u kemm jekk ma fihx apparat ta’ riċezzjoni jew apparat ta’ rrekordjar jew riproduzzjoni; kameras tat-televiżjoni, kameras diġitali u videocameras li jirrekordjaw',
    'Radar apparatus, radio navigational aid apparatus and radio remote control apparatus' => 'Apparat tar-radar, apparat tar-radjunavigazzjoni u apparat tar-radju bil-kontroll mill-bogħod',
    'Reception apparatus for radio-broadcasting, whether or not combined, in the same housing, with sound recording or reproducing apparatus or a clock' => 'Apparat tar-riċezzjoni għax-xandir bir-radju, kemm jekk huwa kkombinat u kemm jekk mhuwiex, fl-istess housing, ma’ apparat għar-rekordjar jew għar-riproduzzjoni tal-ħoss jew ma’ arloġġ',
    'Monitors and projectors, not incorporating television reception apparatus; reception apparatus for television, whether or not incorporating radio-broadcast receivers or sound or video recording or reproducing apparatus' => 'Monitors u projetturi, li ma jinkorporawx apparat ta’ riċezzjoni għat-televiżjoni; apparat tar-riċezzjoni għat-televiżjoni, kemm jekk jinkorpora u kemm jekk ma jinkorporax fih apparat ta’ riċezzjoni tax-xandir bir-radju jew apparat għar-rekordjar jew riproduzzjoni tal-ħoss jew tal-video',
    'Parts suitable for use solely or principally with the apparatus of headings 8524 to 8528' => 'Parts tajbin biss jew prinċipalment għall-użu mal-apparat tal-intestaturi 8524 sa 8528',
    'Electrical signalling, safety or traffic control equipment for railways, tramways, roads, inland waterways, parking facilities, port installations or airfields (other than those of heading 8608)' => 'Sinjalar tal-elettriku, tagħmir tas-sikurezza jew tal-kontroll tat-traffiku għal ferroviji, linji tat-tramm, toroq, kanali tal-ilma interni, faċilitajiet għall-ipparkjar, installazzjonijiet tal-port jew imtajar (għajr dawk tal-intestatura 8608)',
    'Electric sound or visual signalling apparatus (for example, bells, sirens, indicator panels, burglar or fire alarms), other than those of heading 8512 or 8530' => 'Apparat elettriku tas-sinjalar bil-ħoss jew viżwali (eż. qniepen, sireni, pannelli indikaturi, allarmi tas-serq jew tan-nar), għajr dawk tal-intestatura 8512 jew 8530',
    'Electrical capacitors, fixed, variable or adjustable (pre-set)' => 'Kapaċitaturi tal-elettriku, fissi, varjabbli jew aġġustabbli (issettjati minn qabel)',
    'Electrical resistors (including rheostats and potentiometers), other than heating resistors' => 'Reżisturi elettriċi (inkluż reostati u potenzjometri), għajr reżisturi għat-tisħin',
    'Printed circuits' => 'Ċirkwiti stampati',
    'Electrical apparatus for switching or protecting electrical circuits, or for making connections to or in electrical circuits (for example, switches, fuses, lightning arresters, voltage limiters, surge suppressors, plugs and other connectors, junction boxes), for a voltage exceeding 1000 V' => 'Apparat elettriku għall-iswitching jew għall-protezzjoni ta’ ċirkwiti elettriċi, jew biex joħloq konnessjonijiet ma’ jew ġo ċirkwiti elettriċi (eż. swiċċijiet, fuses, apparat li jilqa’ s-sajjetti, apparat li jillimita l-vultaġġ, apparat li jrażżan it-tlugħ f’daqqa tal-kurrent, plugs u konnetturi oħrajn u kaxxi fejn jingħaqdu l-kejbils), għal vultaġġ ogħla minn 1000 V',
    'Electrical apparatus for switching or protecting electrical circuits, or for making connections to or in electrical circuits (for example, switches, relays, fuses, surge suppressors, plugs, sockets, lamp holders and other connectors, junction boxes), for a voltage not exceeding 1000 V; connectors for optical fibres, optical fibre bundles or cables' => 'Apparat elettriku għall-iswitching jew għall-protezzjoni ta’ ċirkwiti elettriċi, jew sabiex jagħmlu konnessjonijiet ma’ jew ġewwa ċirkwiti elettriċi (eż. swiċċijiet, relays, fuses, apparat li jrażżan it-tlugħ f’daqqa tal-kurrent, plugs, sockets, holders tal- lampi u konnetturi oħrajn, kaxxi fejn jingħaqdu l-kejbils), għal vultaġġ li ma jaqbiżx l-1000 V; konnetturi użati għall-fibri ottiċi, faxex jew kejbils ta’ fibri ottiċi',
    'Boards, panels, consoles, desks, cabinets and other bases, equipped with two or more apparatus of heading 8535 or 8536, for electric control or the distribution of electricity, including those incorporating instruments or apparatus of Chapter 90, and numerical control apparatus, other than switching apparatus of heading 8517' => 'Boards, pannelli, consoles, skrivaniji, armarji u bażijiet oħrajn, armati b’biċċtejn apparat jew iktar tal-intestatura 8535 jew 8536, għal kontroll elettriku jew għad-distribuzzjoni tal-elettriku, inkluż dawk li fihom strumenti jew apparat tal-Kapitolu 90, u apparat ta’ kontroll numeriku, għajr apparat ta’ swiċċjar tal-intestatura 8517',
    'Parts suitable for use solely or principally with the apparatus of heading 8535, 8536 or 8537' => 'Parts tajbin biss jew prinċipalment għall-użu mal-apparat tal-intestaturi 8535, 8536 jew 8537',
    'Electric filament or discharge lamps, including sealed beam lamp units and ultraviolet or infra-red lamps; arc-lamps; light-emitting diode (LED) light sources' => 'Lampi tal-elettriku bil-filament jew ta’ skariku, inkluż fanali ssiġillati u lampi ultravjola u tal-infraħmar; lampi b’arka; sorsi ta’ dawl b’dijodu li jemetti d-dawl (LED)',
    'Thermionic, cold cathode or photocathode valves and tubes (for example, vacuum or vapour or gas filled valves and tubes, mercury arc rectifying valves and tubes, cathode ray tubes, television camera tubes)' => 'Valvi u tubi termjoniċi, katodu kiesaħ jew fotokatodu (eż. valvi u tubi vakwi jew mimlijin bil-fwar jew b’gass, valvi u tubi tal-merkurju li jirrettifikaw l-arka, tubi katodiċi, tubi tat-telekamera)',
    'Semiconductor devices (for example, diodes, transistors, semiconductor-based transducers); photosensitive semiconductor devices, including photovoltaic cells whether or not assembled in modules or made up into panels; light-emitting diodes (LED), whether or not assembled with other light-emitting diodes (LED); mounted piezo-electric crystals' => 'Apparati semikondutturi (eż. dijodi, tranżisturi, trasdutturi bbażati fuq semikondutturi); apparati semikondutturi fotosensittivi, inkluż ċelloli fotovoltajċi assemblati f’moduli jew magħmulin f’pannelli jew le; dijodu li jemetti d-dawl (LED), kemm jekk assemblati b’dijodi li jemettu d-dawl (LED) oħrajn u kemm jekk le; kristalli pjeżoelettriċi immuntati',
    'Electronic integrated circuits' => 'Ċirkwiti integrati elettroniċi',
    'Electrical machines and apparatus, having individual functions, not specified or included elsewhere in this chapter' => 'Magni u apparat elettriċi, b’funzjonijiet individwali, mhux speċifikati jew inkluż banda oħra f’dan il-kapitolu',
    'Insulated (including enamelled or anodised) wire, cable (including coaxial cable) and other insulated electric conductors, whether or not fitted with connectors; optical fibre cables, made up of individually sheathed fibres, whether or not assembled with electric conductors or fitted with connectors' => 'Wajer iżolat (inkluż żmaltat jew anodizzat), kejbil (inkluż kejbil koassjali) u kondutturi elettriċi iżolati oħrajn, mgħammrin b’konnetturi jew le; kejbils tal-fibra ottika, magħmulin minn fibri miksijin individwalment, assemblati b’kondutturi elettriċi jew mgħammrin b’konnetturi jew le',
    'Carbon electrodes, carbon brushes, lamp carbons, battery carbons and other articles of graphite or other carbon, with or without metal, of a kind used for electrical purposes' => 'Elettrodi tal-karbonju, brushes tal-karbonju, karbonji tal-lampi, karbonji tal-batteriji u oġġetti oħrajn tal-grafit jew karbonju ieħor, b’metall jew mingħajru, tat-tip użat għal għanijiet elettriċi',
    'Electrical insulators of any material' => 'Iżolaturi elettriċi ta’ kwalunkwe materjal',
    'Insulating fittings for electrical machines, appliances or equipment, being fittings wholly of insulating material apart from any minor components of metal (for example, threaded sockets) incorporated during moulding solely for purposes of assembly, other than insulators of heading 8546; electrical conduit tubing and joints therefor, of base metal lined with insulating material' => 'Fittings iżolanti għal magni, apparat jew tagħmir elettriku, li huma fittings magħmula kompletament minn materjal iżolanti ħlief kwalunkwe komponent minuri tal-metall (eż. sockets bil-kamin) imdaħħal waqt ix-xogħol bil-mol sempliċiment għal għanijiet ta’ mmuntar, għajr iżolaturi tal-intestatura 8546; tubi u ġonot tal-conduits tal-elettriku għalihom, ta’ metall komuni miksi b’materjal iżolatur',
    'Electrical parts of machinery or apparatus, not specified or included elsewhere in this chapter' => 'Parts elettriċi ta’ makkinarju jew apparat, mhux speċifikati jew inklużi banda oħra f’dan il-Kapitolu',
    'Electrical and electronic waste and scrap' => 'Skart u skrapp elettriku u elettroniku',
    'Rail locomotives powered from an external source of electricity or by electric accumulators' => 'Lokomottivi ta’ ferroviji alimentati minn sors tal-elettriku estern jew minn akkumulaturi elettriċi',
    'Other rail locomotives; locomotive tenders' => 'Lokomottivi ferrovjarji oħrajn; tenders lokomottivi',
    'Self-propelled railway or tramway coaches, vans and trucks, other than those of heading 8604' => 'Kowċijiet, vannijiet u trakkijiet awtopropulsivi tal-linji ferrovjarji jew tat-tramm, għajr dawk tal-intestatura 8604',
    'Railway or tramway goods vans and wagons, not self-propelled' => 'Vannijiet u vaguni tal-merkanzija tal-linji ferrovjarji jew tat-tramm, mhux awtopropulsivi',
    'Parts of railway or tramway locomotives or rolling stock' => 'Parts ta’ lokomottivi jew ta’ rolling stock tal-linji ferrovjarji jew tat-tramm',
    'Containers (including containers for the transport of fluids) specially designed and equipped for carriage by one or more modes of transport' => 'Containers (inkluż containers għat-trasport ta’ fluwidi) maħdumin apposta u mgħammrin għal ġarr b’mod ta’ trasport wieħed jew iktar',
    'Tractors (other than tractors of heading 8709)' => 'Tratturi (ħlief tratturi tal-intestatura 8709)',
    'Motor vehicles for the transport of ten or more persons, including the driver' => 'Vetturi bil-mutur għat-trasport ta’ għaxar persuni jew iktar, inkluż ix-xufier',
    'Motor cars and other motor vehicles principally designed for the transport of persons (other than those of heading 8702), including station wagons and racing cars' => 'Karozzi bil-mutur u vetturi oħrajn bil-mutur prinċipalment maħsubin għat-trasport ta’ persuni (ħlief dawk tal-intestatura 8702), inkluż stationwagons u karozzi tat-tlielaq',
    'Motor vehicles for the transport of goods' => 'Vetturi bil-mutur għat-trasport ta’ oġġetti',
    'Special purpose motor vehicles, other than those principally designed for the transport of persons or goods (for example, breakdown lorries, crane lorries, fire fighting vehicles, concrete-mixer lorries, road sweeper lorries, spraying lorries, mobile workshops, mobile radiological units)' => 'Vetturi bil-mutur għal użu speċjali, ħlief dawk prinċipalment maħsubin għat-trasport ta’ persuni u oġġetti (eż. trakkijiet għall-ħsarat, trakkijiet krejn, vetturi għat-tifi tan-nar, trakkijiet tal-mixers tal-konkos, trakkijiet għall-knis tat-toroq, trakkijiet biex ibexxu, workshops mobbli, unitajiet radjoloġiċi mobbli)',
    'Chassis fitted with engines, for the motor vehicles of headings 8701 to 8705' => 'Xażijiet armati bil-magni, għall-vetturi tal-intestaturi 8701 sa 8705',
    'Bodies (including cabs), for the motor vehicles of headings 8701 to 8705' => 'Bodies (inkluż kabini), għall-vetturi bil-mutur tal-intestaturi 8701 sa 8705',
    'Parts and accessories of the motor vehicles of headings 8701 to 8705' => 'Parts u aċċessorji tal-vetturi bil-mutur tal-intestaturi 8701 sa 8705',
    'Works trucks, self-propelled, not fitted with lifting or handling equipment, of the type used in factories, warehouses, dock areas or airports for short distance transport of goods; tractors of the type used on railway station platforms; parts of the foregoing vehicles' => 'Trakkijiet tax-xogħol, awtopropulsivi mhux armati b’tagħmir għall-irfigħ jew għall-ispustjar, tat-tip użat f’fabbriki, imħażen, madwar baċiri jew ajruporti għat-trasport ta’ oġġetti fuq distanzi qosra; tratturi tat-tip użat fuq pjattaformi ta’ stazzjonijiet tal-ferrovija; parts ta’ dawn il-vetturi t’hawn fuq',
    'Motorcycles (including mopeds) and cycles fitted with an auxiliary motor, with or without side-cars; side-cars' => 'Muturi (inkluż mopeds) u roti mgħammrin b’mutur awżiljarju, bis-side-cars jew le; side-cars',
    'Bicycles and other cycles (including delivery tricycles), not motorised' => 'Biċikletti u roti oħrajn (inkluż triċikletti għat-tqassim), mhux motorizzati',
    'Carriages for disabled persons, whether or not motorised or otherwise mechanically propelled' => 'Vetturi għall-ġarr ta’ persuni b’diżabbiltà, motorizzati jew le jew immexxijin b’mod ieħor mekkaniku',
    'Parts and accessories of vehicles of headings 8711 to 8713' => 'Parts u aċċessorji ta’ vetturi tal-intestaturi 8711 sa 8713',
    'Baby carriages and parts thereof' => 'Mezzi għall-ġarr tat-trabi u parts tagħhom',
    'Trailers and semi-trailers; other vehicles, not mechanically propelled; parts thereof' => 'Trejlers u semitrejlers; vetturi oħrajn, mhux immexxijin b’mod mekkaniku; parts tagħhom',
    'Balloons and dirigibles; gliders, hang gliders and other non-powered aircraft' => 'Blalen tal-ajru u bastimenti tal-ajru diriġibbli; gliders, hang gliders u inġenji oħrajn tal-ajru mhux motorizzati',
    'Other aircraft (for example, helicopters, aeroplanes), except unmanned aircraft of heading 8806; spacecraft (including satellites) and suborbital and spacecraft launch vehicles' => 'Inġenji tal-ajru (eż. ħelikopters, ajruplani) ħlief inġenji tal-ajru mingħajr bdot abbord tal-intestatura 8806; inġenji tal-ispazju (inkluż satelliti) u vetturi suborbitali u biex jillanċjaw inġenji tal-ispazju',
    'Aircraft launching gear; deck-arrestor or similar gear; ground flying trainers; parts of the foregoing articles' => 'Armar għall-illanċjar tal-inġenji tal-ajru; armar ta’ deck-arrestor u armar simili; inġenji fuq l-art għat-taħriġ fit-titjir; parts tal-oġġetti msemmijin fuq',
    'Unmanned aircraft' => 'Inġenji tal-ajru mingħajr bdot abbord',
