    'Cruise ships, excursion boats, ferry-boats, cargo ships, barges and similar vessels for the transport of persons or goods' => 'Vapuri tal-kruċieri, dgħajjes tal-eskursjonijiet, ferry-boats, bastimenti tat-tagħbija, braken u bastimenti simili għat-trasport ta’ persuni jew oġġetti',
    'Fishing vessels; factory ships and other vessels for processing or preserving fishery products' => 'Bastimenti tas-sajd; bastimenti fabbrika u bastimenti oħrajn biex jipproċessaw jew jippreservaw prodotti tas-sajd',
