    'Tugs and pusher craft' => 'Laneċ tal-irmonk u mezzi li jimbuttaw',
    'Light-vessels, fire-floats, dredgers, floating cranes, and other vessels the navigability of which is subsidiary to their main function; floating docks; floating or submersible drilling or production platforms' => 'Bastimenti ħfief, fire-floats, ħammiela, krejnijiet li jżommu f’wiċċ l-ilma, u bastimenti oħrajn li l-kundizzjoni ta’ tbaħħir tagħhom hija sekondarja għall-funzjoni prinċipali tagħhom; floating docks; pjattaformi għat-tħaffir jew għall-produzzjoni li jżommu f’wiċċ l-ilma jew sommerġibbli',
    'Other vessels, including warships and lifeboats other than rowing boats' => 'Bastimenti oħrajn, inkluż bastimenti tal-gwerra u dgħajjes tas-sopravivenza għajr dgħajjes tal-qdif',
    'Other floating structures (for example, rafts, tanks, coffer-dams, landing stages, buoys and beacons)' => 'Strutturi oħrajn li jżommu f’wiċċ l-ilma (eż. ċattri, tankijiet, coffer-dams, pjattaformi tal-iżbark, bagi u beacons)',
    'Optical fibres and optical fibre bundles; optical fibre cables other than those of heading 8544; sheets and plates of polarising material; lenses (including contact lenses), prisms, mirrors and other optical elements, of any material, unmounted, other than such elements of glass not optically worked' => 'Fibri ottiċi u mazzi tal-fibri ottiċi; kejbils tal-fibri ottiċi għajr dawk tal-intestatura 8544; folji u pjanċi ta’ materjal polarizzanti; lentijiet (inkluż contact lenses), priżmi, mirja u elementi ottiċi oħrajn, ta’ kwalunkwe materjal, mhux immuntati, għajr elementi bħal dawn tal-ħġieġ mhux maħdumin ottikament',
    'Lenses, prisms, mirrors and other optical elements, of any material, mounted, being parts of or fittings for instruments or apparatus, other than such elements of glass not optically worked' => 'Lentijiet, priżmi, mirja u elementi ottiċi oħrajn, ta’ kwalunkwe materjal, immuntati, li huma parts jew fittings għal strumenti jew apparat, għajr dawk l-elementi tal-ħġieġ mhux maħdumin ottikament',
    'Frames and mountings for spectacles, goggles or the like, and parts thereof' => 'Frames u montaturi għan-nuċċalijiet, għall-gogils jew bħalhom, u l-parts tagħhom',
    'Spectacles, goggles and the like, corrective, protective or other' => 'Nuċċalijiet, gogils u bħalhom, korrettivi, protettivi jew oħrajn',
    'Binoculars, monoculars, other optical telescopes, and mountings therefor; other astronomical instruments and mountings therefor, but not including instruments for radio-astronomy' => 'Binokli, monokli, teleskopji ottiċi oħrajn, u l-montaturi għalihom; strumenti astronomiċi oħrajn u l-montaturi għalihom, iżda ħlief l-istrumenti għar-radjoastronomija',
    'Photographic (other than cinematographic) cameras; photographic flashlight apparatus and flashbulbs other than discharge lamps of heading 8539' => 'Kameras fotografiċi (għajr dawk ċinematografiċi); apparat tal-flaxx u bozoz tal-flaxx fotografiċi għajr il-lampi ta’ skariku tal-intestatura 8539',
    'Cinematographic cameras and projectors, whether or not incorporating sound recording or reproducing apparatus' => 'Cameras u proġekters ċinematografiċi, kemm jekk jinkorporaw apparat għar-reġistrazzjoni jew għar-riproduzzjoni tal-ħoss u kemm jekk le',
    'Image projectors, other than cinematographic; photographic (other than cinematographic) enlargers and reducers' => 'Proġekters tal-immaġni, għajr ċinematografiċi; apparat li jkabbar jew iċekken ir-ritratti (għajr ċinematografiku)',
    'Apparatus and equipment for photographic (including cinematographic) laboratories, not specified or included elsewhere in this chapter; negatoscopes; projection screens' => 'Apparat u tagħmir għal-laboratorji fotografiċi (inkluż ċinematografiċi), mhux speċifikati jew inklużi banda oħra f’dan il-kapitolu; negatoscopes; skrins għall-projezzjoni',
    'Compound optical microscopes, including those for photomicrography, cinephotomicrography or microprojection' => 'Mikroskopji ottiċi komposti, inkluż dawk għall-fotomikrografija, għaċ-ċinefotomikrografija jew għall-mikroprojezzjoni',
    'Microscopes other than optical microscopes; diffraction apparatus' => 'Mikroskopji għajr il-mikroskopji ottiċi; apparat ta’ difrazzjoni',
    'Lasers, other than laser diodes; other optical appliances and instruments, not specified or included elsewhere in this chapter' => 'Il-lasers, għajr id-dijodi tal-laser; apparat u strumenti ottiċi oħrajn, mhux speċifikati jew inklużi banda oħra f’dan il-Kapitolu',
    'Direction finding compasses; other navigational instruments and appliances' => 'Boxxli inkluż dawk għan-navigazzjoni; strumenti u apparati oħrajn għan-navigazzjoni',
    'Surveying (including photogrammetrical surveying), hydrographic, oceanographic, hydrological, meteorological or geophysical instruments and appliances, excluding compasses; rangefinders' => 'Strumenti u apparat topometriċi (inkluż topometrija fotogrammetrika), idrografiċi, oċeanografiċi, idroloġiċi, meteoroloġiċi jew ġeofiżiċi, ħlief il-boxxli; telemetri',
    'Balances of a sensitivity of 5 cg or better, with or without weights' => 'Imwieżen ta’ sensittività ta’ 5 cg jew aħjar, kemm jekk bl-użini u kemm jekk le',
    'Drawing, marking-out or mathematical calculating instruments (for example, drafting machines, pantographs, protractors, drawing sets, slide rules, disc calculators); instruments for measuring length, for use in the hand (for example, measuring rods and tapes, micrometers, callipers), not specified or included elsewhere in this chapter' => 'Strumenti għat-tpinġija, għall-immarkar jew għall-kalkoli matematiċi (eż. il-magni għall-abbozzar, il-pantografi, il-protractors, is-settijiet tad-disinjar, ir-rigi li jislajdjaw, il-kalkulaturi f’għamla ta’ diska); strumenti għall-kejl tat-tul, għall-użu fl-idejn (eż. il-vireg u r-rutelli tal-kejl, il-mikrometri, il-callipers), mhux speċifikati jew inklużi banda oħra f’dan il-kapitolu',
    'Instruments and appliances used in medical, surgical, dental or veterinary sciences, including scintigraphic apparatus, other electromedical apparatus and sight-testing instruments' => 'Strumenti u apparati li jintużaw fix-xjenzi mediċi, kirurġiċi, dentali jew veterinarji, inkluż l-apparat xintigrafiku, apparat ieħor elettromediku u strumenti għall-eżamijiet tal-vista',
    'Mechano-therapy appliances; massage apparatus; psychological aptitude-testing apparatus; ozone therapy, oxygen therapy, aerosol therapy, artificial respiration or other therapeutic respiration apparatus' => 'Apparat għat-terapija mekkanika; apparat għall-massaġġi; apparat għat-testijiet tal-kapaċità psikoloġika; apparat għat-terapija bl-ożonu, għat-terapija bl-ossiġenu, għat-terapija bl-aerosol, għar-respirazzjoni artifiċjali jew għal respirazzjoni terapewtika oħra',
    'Other breathing appliances and gas masks, excluding protective masks having neither mechanical parts nor replaceable filters' => 'Apparat ieħor ta’ respirazzjoni u l-maskri tal-gass, ħlief il-maskri protettivi li la fihom partijiet mekkaniċi u lanqas filtri sostitwibbli',
    'Orthopaedic appliances, including crutches, surgical belts and trusses; splints and other fracture appliances; artificial parts of the body; hearing aids and other appliances which are worn or carried, or implanted in the body, to compensate for a defect or disability' => 'Apparat ortopediku, inkluż krozzi, ċinturini kirurġiċi u ċinturini tal-ftuq; qassaba u apparat ieħor għall-fratturi; parts artifiċjali tal-ġisem; hearing aids u apparat ieħor li jintlibes jew jinġarr, jew li jiġi impjantat fil-ġisem, biex jagħmel tajjeb għal difett jew diżabbiltà',
    'Apparatus based on the use of X-rays or of alpha, beta, gamma or other ionising radiation, whether or not for medical, surgical, dental or veterinary uses, including radiography or radiotherapy apparatus, X-ray tubes and other X-ray generators, high tension generators, control panels and desks, screens, examination or treatment tables, chairs and the like' => 'Apparat ibbażat fuq l-użu tar-raġġi-X jew fuq ir-radjazzjonijiet alfa, beta gamma jew jonizzanti oħrajn, kemm jekk għall-użi mediċi, kirurġiċi, dentali jew veterinarji u kemm jekk le, inkluż l-apparat għar-radjografija jew għar-radjoterapija, it-tubi tar-raġġi-X u ġeneraturi oħrajn tar-raġġi-X, il-ġeneraturi ta’ tensjoni għolja, il-panels u d-desks ta’ kontroll, l-iskrins, l-imwejjed, is-siġġijiet u affarijiet simili għall-eżaminazzjoni jew għat-trattament',
    'Instruments, apparatus and models, designed for demonstrational purposes (for example, in education or exhibitions), unsuitable for other uses' => 'Strumenti, apparat u mudelli, maħsubin għall-finijiet ta’ dimostrazzjoni (eż. fl-edukazzjoni jew għall-wirjiet), mhux tajbin għal użi oħrajn',
    'Machines and appliances for testing the hardness, strength, compressibility, elasticity or other mechanical properties of materials (for example, metals, wood, textiles, paper, plastics)' => 'Magni u apparati biex jiġu ttestjati l-ebusija, is-saħħa, il-kompressibiltà, l-elastiċità jew proprjetajiet mekkaniċi oħrajn tal-materjali (eż. il-metalli, l-injam, it-tessuti, il-karta, il-plastik)',
    'Hydrometers and similar floating instruments, thermometers, pyrometers, barometers, hygrometers and psychrometers, recording or not, and any combination of these instruments' => 'Idrometri u strumenti simili li jżommu f’wiċċ l-ilma, termometri, pirometri, barometri, igrometri u psikrometri, li jirreġistraw jew le, u kwalunkwe kombinament ta’ dawn l-istrumenti',
    'Instruments and apparatus for measuring or checking the flow, level, pressure or other variables of liquids or gases (for example, flow meters, level gauges, manometers, heat meters), excluding instruments and apparatus of heading 9014, 9015, 9028 or 9032' => 'Strumenti u apparati għall-kejl jew għall-iċċekkjar tal-fluss, tal-livell, tal-pressjoni jew kwantitajiet varjabbli oħra tal-likwidi jew tal-gassijiet (eż. il-flussimetri, il-gauges għal-livell, il-manometri, il-miters tas-sħana), ħlief l-istrumenti u l-apparat tal-intestaturi 9014, 9015, 9028 jew 9032',
    'Instruments and apparatus for physical or chemical analysis (for example, polarimeters, refractometers, spectrometers, gas or smoke analysis apparatus); instruments and apparatus for measuring or checking viscosity, porosity, expansion, surface tension or the like; instruments and apparatus for measuring or checking quantities of heat, sound or light (including exposure meters); microtomes' => 'Strumenti u apparati għall-analiżi fiżika jew kimika (eż. il-polarimetri, ir-rifrattometri, l-ispettrometri, l-apparat għall-analiżi tal-gassijiet jew tad-dħaħen); strumenti u apparat għall-kejl jew għall-iċċekkjar tal-viskożità, tal-porożità, tal-espansjoni, tat-tensjoni tas-superfiċje jew bħalhom; strumenti u apparat għall-kejl jew għall-iċċekkjar tal-kwantitajiet ta’ sħana, ħoss jew dawl (inkluż miters ta’ esponiment); mikrotomi',
    'Gas, liquid or electricity supply or production meters, including calibrating meters therefor' => 'Miters għall-forniment jew għall-produzzjoni ta’ gassijiet, likwidi jew tal-elettriku, inkluż miters għall-kalibrar tagħhom',
    'Revolution counters, production counters, taximeters, milometers, pedometers and the like; speed indicators and tachometers, other than those of heading 9014 or 9015; stroboscopes' => 'Kuntjaturi tar-rivoluzzjonijiet, kuntjaturi tal-produzzjoni, tassimetri, milometri, pedometri u bħalhom; indikaturi tal-veloċità u takometri, għajr dawk tal-intestatura 9014 jew 9015; stroboskopji',
    'Oscilloscopes, spectrum analysers and other instruments and apparatus for measuring or checking electrical quantities, excluding meters of heading 9028; instruments and apparatus for measuring or detecting alpha, beta, gamma, X-ray, cosmic or other ionising radiation' => 'Oxxilloskopji, analizzaturi tal-ispettru u strumenti u apparati oħrajn għall-kejl jew għall-iċċekkjar tal-kwantitajiet elettriċi, ħlief il-miters tal-intestatura 9028; strumenti u apparat għall-kejl jew għad-detezzjoni tar-radjazzjoni mir-raġġi alfa, beta, gamma u r-raġġi-X, tar-radjazzjoni kożmika jew radjazzjoni jonizzanti oħra',
    'Measuring or checking instruments, appliances and machines, not specified or included elsewhere in this chapter; profile projectors' => 'Strumenti, apparat u magni għall-kejl jew għall-iċċekkjar, mhux speċifikati jew inklużi banda oħra f’dan il-kapitolu; proġekters tal-profili',
    'Automatic regulating or controlling instruments and apparatus' => 'Strumenti u apparat awtomatiċi li jirregolaw jew jikkontrollaw',
    'Parts and accessories (not specified or included elsewhere in this chapter) for machines, appliances, instruments or apparatus of Chapter 90' => 'Parts u aċċessorji (mhux speċifikati jew inklużi banda oħra f’dan il-kapitolu) għall-magni, għall-apparat jew għall-istrumenti tal-Kapitolu 90',
    'Wristwatches, pocket-watches and other watches, including stopwatches, with case of precious metal or of metal clad with precious metal' => 'Arloġġi tal-idejn, arloġġi tal-but u arloġġi żgħar oħrajn, inkluż stopwatches, bil-case magħmula minn metall prezzjuż jew minn metall imlibbes b’metall prezzjuż',
    'Wristwatches, pocket-watches and other watches, including stopwatches, other than those of heading 9101' => 'Arloġġi tal-idejn, arloġġi tal-but u arloġġi żgħar oħrajn, inkluż stopwatches, għajr dawk tal-intestatura 9101',
    'Clocks with watch movements, excluding clocks of heading 9104' => 'Arloġġi b’mekkaniżmi ta’ arloġġ tal-idejn, ħlief l-arloġġi tal-intestatura 9104',
    'Other clocks' => 'Arloġġi oħrajn',
    'Time of day recording apparatus and apparatus for measuring, recording or otherwise indicating intervals of time, with clock or watch movement or with synchronous motor (for example, time-registers, time-recorders)' => 'Apparat li jirreġistra l-ħin tal-ġurnata u apparat li jkejjel, jirreġistra jew jindika b’mod ieħor l-intervalli tal-ħin, b’mekkaniżmu ta’ arloġġ jew ta’ arloġġ tal-idejn jew b’mutur sinkroniku (eż. ir-reġistraturi tal-ħin, ir-rekorders tal-ħin)',
    'Watch movements, complete and assembled' => 'Mekkaniżmi ta’ arloġġ tal-idejn, kompluti u assemblati',
