    'Complete watch or clock movements, unassembled or partly assembled (movement sets); incomplete watch or clock movements, assembled; rough watch or clock movements' => 'Mekkaniżmi sħaħ ta’ arloġġ tal-idejn jew ta’ arloġġ, mhux assemblati jew assemblati parzjalment (settijiet ta’ mekkaniżmi); mekkaniżmi mhux kompluti ta’ arloġġ tal-idejn jew ta’ arloġġ, assemblati; mekkaniżmi raffi ta’ arloġġ tal-idejn jew ta’ arloġġ',
    'Watch cases and parts thereof' => 'Cases tal-arloġġi tal-idejn u tal-but u l-parts tagħhom',
    'Clock cases and cases of a similar type for other goods of this chapter, and parts thereof' => 'Cases tal-arloġġi u cases simili għal oġġetti oħrajn ta’ dan il-kapitolu, u l-parts tagħhom',
    'Watch straps, watch bands and watch bracelets, and parts thereof' => 'Ċineg tal-arloġġi tal-idejn, bands tal-arloġġi tal-idejn u brazzuletti tal-arloġġi tal-idejn, u l-parts tagħhom',
    'Other clock or watch parts' => 'Parts oħrajn tal-arloġġi jew tal-arloġġi tal-idejn jew tal-but',
    'Pianos, including automatic pianos; harpsichords and other keyboard stringed instruments' => 'Pjanijiet, inkluż il-pjanijiet awtomatiċi; klaviċembali u strumenti oħrajn bit-tastiera u bil-kordi',
    'Other string musical instruments (for example, guitars, violins, harps)' => 'Strumenti mużikali oħrajn tal-korda (eż. kitarri, vjolini, arpi)',
    'Wind musical instruments (for example, keyboard pipe organs, accordions, clarinets, trumpets, bagpipes), other than fairground organs and mechanical street organs' => 'Strumenti mużikali tan-nifs (eż. orgnijiet bit-tastiera u bil-pajpijiet, akkordjins, klarinetti, trumbetti, ċirimelli), għajr l-orgnijiet tal-fieri u l-orgnijiet mekkaniċi tat-triq',
    'Musical instruments, the sound of which is produced, or must be amplified, electrically (for example, organs, guitars, accordions)' => 'Strumenti mużikali, li l-ħoss tagħhom huwa prodott, jew irid ikun amplifikat, bl-elettriku (eż. orgnijiet, kitarri, akkordjins)',
    'Musical boxes, fairground organs, mechanical street organs, mechanical singing birds, musical saws and other musical instruments not falling within any other heading of this chapter; decoy calls of all kinds; whistles, call horns and other mouth-blown sound signalling instruments' => 'Kaxxi mużikali, orgnijiet tal-fieri, orgnijiet mekkaniċi tat-triq, għasafar tal-għana mekkaniċi, srieraq mużikali u strumenti mużikali oħrajn li ma jaqgħux fi kwalunkwe intestatura oħra ta’ dan il-kapitolu; sejħiet tal-insib ta’ kull tip; sfafar, qrun tad-daqq u strumenti oħrajn li jindaqqu bil-ħalq għas-sinjalar akustiku',
    'Parts (for example, mechanisms for musical boxes) and accessories (for example, cards, discs and rolls for mechanical instruments) of musical instruments; metronomes, tuning forks and pitch pipes of all kinds' => 'Parts (eż. mekkaniżmi għall-kaxxi mużikali) u aċċessorji (eż. kards, id-diski u rombli għall-istrumenti mekkaniċi) tal-istrumenti mużikali; metronomi, tuning-forks u pitch pipes ta’ kull tip',
