    'Parts and accessories of articles of headings 9301 to 9304' => 'Parts u aċċessorji tal-oġġetti tal-intestaturi 9301 sa 9304',
    'Bombs, grenades, torpedoes, mines, missiles and similar munitions of war and parts thereof; cartridges and other ammunition and projectiles and parts thereof, including shot and cartridge wads' => 'Bombi, granati, torpedoes, mini, missili u munizzjonijiet simili tal-gwerra u l-parts tagħhom; skrataċ u munizzjon u projettili oħrajn u l-parts tagħhom, inkluż l-istopop tat-tiri u tal-iskrataċ',
    'Seats (other than those of heading 9402), whether or not convertible into beds, and parts thereof' => 'Sits (għajr dawk tal-intestatura 9402) kemm jekk jinbidlu f’sodod jew le, u l-parts tagħhom',
    'Medical, surgical, dental or veterinary furniture (for example, operating tables, examination tables, hospital beds with mechanical fittings, dentists\' chairs); barbers\' chairs and similar chairs, having rotating as well as both reclining and elevating movements; parts of the foregoing articles' => 'Għamara medika, tal-kirurġija, dentali jew veterinarja (eż. l-imwejjed tal-operazzjoni, l-imwejjed għall-eżaminazzjonijiet, is-sodod tal-isptarijiet b’fittings mekkaniċi, is-siġġijiet tad-dentisti); siġġijiet tal-barbiera u siġġijiet simili, li jkollhom movimenti li jduru kif ukoll li jinżlu u jogħlew; parts għall-oġġetti msemmijin hawn fuq',
    'Other furniture and parts thereof' => 'Għamara oħra u l-parts tagħha',
    'Mattress supports; articles of bedding and similar furnishing (for example, mattresses, quilts, eiderdowns, cushions, pouffes and pillows) fitted with springs or stuffed or internally fitted with any material or of cellular rubber or plastics, whether or not covered' => 'Irfid għas-saqqijiet; oġġetti tal-friex u arredament simili (eż. imtieraħ, kwilts, kutri mimlijin bir-rix tal-edredun, cushions, pouffes u mħaded) iffittjati bil-molol jew mimlijin jew iffittjati minn ġewwa bi kwalunkwe materjal jew tal-lastiku jew tal-plastik ċellulari, kemm jekk miksijin u kemm jekk le',
    'Luminaires and lighting fittings including searchlights and spotlights and parts thereof, not elsewhere specified or included; illuminated signs, illuminated nameplates and the like, having a permanently fixed light source, and parts thereof not elsewhere specified or included' => 'Luminarji u fittings tat-tidwil inkluż searchlights u spotlights u l-parts tagħhom, mhux speċifikati jew inklużi banda oħra; sinjali mdawlin, pjanċi tal-ismijiet imdawlin u bħalhom, li għandhom sors ta’ dawl imwaħħal b’mod fiss, u l-parts tagħhom mhux speċifikati jew inklużi banda oħra',
    'Prefabricated buildings' => 'Bini prefabbrikat',
    'Tricycles, scooters, pedal cars and similar wheeled toys; dolls\' carriages; dolls; other toys; reduced-size (scale) models and similar recreational models, working or not; puzzles of all kinds' => 'Triċikli, scooters, karozzi bil-pedali u ġugarelli bir-roti simili; karrozzelli tal-pupi; pupi; ġugarelli oħra; mudelli b’daqs (skala) ridott u mudelli ta’ rikreazzjoni simili, kemm jekk jaħdmu u kemm jekk le; puzzles ta’ kull tip',
    'Video game consoles and machines, table or parlour games, including pintables, billiards, special tables for casino games and automatic bowling equipment, amusement machines operated by coins, banknotes, bank cards, tokens or by any other means of payment' => 'Consoles u magni tal-logħob vidjow, logħob tal-mejda jew tas-salott, inkluż pintables, biljards, imwejjed speċjali għal-logħob tal-casino u tagħmir awtomatiku tas-swali tal-bowling, magni ta’ divertiment li jaħdmu bil-muniti, bil-karti tal-flus, bil-kards tal-bank, bit-tokens jew xi metodi oħra ta’ ħlas',
    'Festive, carnival or other entertainment articles, including conjuring tricks and novelty jokes' => 'Oġġetti festivi, tal-karnival jew ta’ divertiment ieħor, inkluż logħob tal-maġija u n-novelty jokes',
    'Articles and equipment for general physical exercise, gymnastics, athletics, other sports (including table tennis) or outdoor games, not specified or included elsewhere in this chapter; swimming pools and paddling pools' => 'Oġġetti u tagħmir għall-eżerċizzju fiżiku ġenerali, għall-ġinnastika, għall-atletika, għal sport ieħor (inkluż table tennis) jew għal-logħob ta’ barra, mhux speċifikati jew inklużi banda oħra f’dan il-kapitolu; pixxini għall-għawm u pixxini baxxi għaċ-ċafċif',
