    'Travelling circuses and travelling menageries; amusement park rides and water park amusements; fairground amusements, including shooting galleries; travelling theatres' => 'Ċirkli u wirjiet tal-annimali li jivvjaġġaw; rikbiet fil-parks ta’ divertiment u d-divertiment fil-parks akkwatiċi; divertiment tal-fieri, inkluż kmamar tal-isparar; teatri li jivvjaġġaw',
    'Worked ivory, bone, tortoiseshell, horn, antlers, coral, mother-of-pearl and other animal carving material, and articles of these materials (including articles obtained by moulding)' => 'Avorju, għadam, qoxra tal-fekruna, qrun, qrun imsaġġrin, qroll, madreperla u materjal ieħor tal-annimali għall-intaljar maħdum, u l-oġġetti ta’ dawn il-materjali (inkluż oġġetti magħmulin permezz tax-xogħol bil-mol)',
