    'Buttons, press-fasteners, snap-fasteners and press studs, button moulds and other parts of these articles; button blanks' => 'Buttuni, fiminelli, forom għall-buttuni u parts oħrajn ta’ dawn l-oġġetti; blanks għall-buttuni',
    'Slide fasteners and parts thereof' => 'Żippijiet u l-parts tagħhom',
