    'Scent sprays and similar toilet sprays, and mounts and heads therefor; powder-puffs and pads for the application of cosmetics or toilet preparations' => 'Sprejs tal-fwieħa u sprejs simili tat-twaletta, u l-montaturi u l-irjus għalihom; puffs u pads għat-terra għall-applikazzjoni tal-kożmetiċi jew għall-preparazzjonijiet tat-twaletta',
    'Sanitary towels (pads) and tampons, napkins (diapers), napkin liners and similar articles, of any material' => 'Assorbenti sanitarji (pads) u tampons, ħrieqi, inforor tal-ħrieqi u oġġetti simili, ta’ kwalunkwe materjal',
